INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('94133727-b59a-424d-94ec-a39ea77f03b7', 'Star Wars: Episode IV - A New Hope', false, 'The Imperial Forces, under orders from cruel Darth Vader, hold Princess Leia hostage in their efforts to quell the rebellion against the Galactic Empire. Luke Skywalker and Han Solo, captain of the Millennium Falcon, work together with the companionable droid duo R2-D2 and C-3PO to rescue the beautiful princess, help the Rebel Alliance and restore freedom and justice to the Galaxy.', 8.6, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('8773096c-5c87-4797-802e-aa7178f17ed8', 'Star Wars: Episode V - The Empire Strikes Back', false, 'Luke Skywalker, Han Solo, Princess Leia and Chewbacca face attack by the Imperial forces and its AT-AT walkers on the ice planet Hoth. While Han and Leia escape in the Millennium Falcon, Luke travels to Dagobah in search of Yoda. Only with the Jedi master''s help will Luke survive when the dark side of the Force beckons him into the ultimate duel with Darth Vader.', 8.7, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('28a3e64e-b59b-45db-aa00-cd20e395b7e1', 'Star Wars: Episode VI - Return of the Jedi', false, 'Luke Skywalker battles horrible Jabba the Hut and cruel Darth Vader to save his comrades in the Rebel Alliance and triumph over the Galactic Empire. Han Solo and Princess Leia reaffirm their love and team with Chewbacca, Lando Calrissian, the Ewoks and the androids C-3PO and R2-D2 to aid in the disruption of the Dark Side and the defeat of the evil emperor.', 8.3, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('c7c0f30e-b1c7-4d03-ba8d-9fb27bfc8673', 'Star Wars: Episode VII - The Force Awakens', false, '30 years after the defeat of Darth Vader and the Empire, Rey, a scavenger from the planet Jakku, finds a BB-8 droid that knows the whereabouts of the long lost Luke Skywalker. Rey, as well as a rogue stormtrooper and two smugglers, are thrown into the middle of a battle between the Resistance and the daunting legions of the First Order.', 7.9, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('50167d64-2880-4d25-8e71-6c6f49628487', 'Star Wars: Episode I - The Phantom Menace', false, 'The evil Trade Federation, led by Nute Gunray is planning to take over the peaceful world of Naboo. Jedi Knights Qui-Gon Jinn and Obi-Wan Kenobi are sent to confront the leaders. But not everything goes to plan. The two Jedi escape, and along with their new Gungan friend, Jar Jar Binks head to Naboo to warn Queen Amidala, but droids have already started to capture Naboo and the Queen is not safe there. Eventually, they land on Tatooine, where they become friends with a young boy known as Anakin Skywalker. Qui-Gon is curious about the boy, and sees a bright future for him. The group must now find a way of getting to Coruscant and to finally solve this trade dispute, but there is someone else hiding in the shadows. Are the Sith really extinct? Is the Queen really who she says she is? And what''s so special about this young boy?', 6.5, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('5bc765fd-624a-4e94-836c-ee131c76eeb8', 'Star Wars: Episode III - Revenge of the Sith', false, 'Near the end of the Clone Wars, Darth Sidious has revealed himself and is ready to execute the last part of his plan to rule the galaxy. Sidious is ready for his new apprentice, Darth Vader, to step into action and kill the remaining Jedi. Vader, however, struggles to choose the dark side and save his wife or remain loyal to the Jedi order.', 7.5, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('ab492d94-0859-48b9-bf92-4dc291c5c4fc', 'Star Wars: Episode II - Attack of the Clones', false, 'Ten years after the invasion of Naboo, the Galactic Republic is facing a Separatist movement and the former queen and now Senator Padm√© Amidala travels to Coruscant to vote on a project to create an army to help the Jedi to protect the Republic. Upon arrival, she escapes from an attempt to kill her, and Obi-Wan Kenobi and his Padawan Anakin Skywalker are assigned to protect her. They chase the shape-shifter Zam Wessell but she is killed by a poisoned dart before revealing who hired her. The Jedi Council assigns Obi-Wan Kenobi to discover who has tried to kill Amidala and Anakin to protect her in Naboo. Obi-Wan discovers that the dart is from the planet Kamino, and he heads to the remote planet. He finds an army of clones that has been under production for years for the Republic and that the bounty hunter Jango Fett was the matrix for the clones. Meanwhile Anakin and Amidala fall in love with each other, and he has nightmarish visions of his mother. They travel to his home planet, Tatooine, to see his mother, and he discovers that she has been abducted by Tusken Raiders. Anakin finds his mother dying, and he kills all the Tusken tribe, including the women and children. Obi-Wan follows Jango Fett to the planet Geonosis where he discovers who is behind the Separatist movement. He transmits his discoveries to Anakin since he cannot reach the Jedi Council. Who is the leader of the Separatist movement? Will Anakin receive Obi-Wan''s message? And will the secret love between Anakin and Amidala succeed?', 6.5, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('d3ec39dd-bd76-4b0d-ab9c-a69118aaf59a', 'Star Trek', true, 'On the day of James Kirk''s birth, his father dies on his damaged starship in a last stand against a Romulan mining vessel looking for Ambassador Spock, who in this time, has grown on Vulcan disdained by his neighbors for his half-human heritage. 25 years later, James T. Kirk has grown into a young rebellious troublemaker. Challenged by Captain Christopher Pike to realize his potential in Starfleet, he comes to annoy academy instructors like Commander Spock. Suddenly, there is an emergency on Vulcan and the newly-commissioned USS Enterprise is crewed with promising cadets like Nyota Uhura, Hikaru Sulu, Pavel Chekov and even Kirk himself, thanks to Leonard McCoy''s medical trickery. Together, this crew will have an adventure in the final frontier where the old legend is altered forever as a new version of the legend begins.', 7.9, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('9fe96fc5-4fe1-4e0d-8155-b562725fd8f1', 'Star Wars: Episode VIII - The Last Jedi', false, 'Rey develops her newly discovered abilities with the guidance of Luke Skywalker, who is unsettled by the strength of her powers. Meanwhile, the Resistance prepares for battle with the First Order.', 7, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('c02bc9c8-a3f4-411c-a5e7-4b3f5af32011', 'Rogue One: A Star Wars Story', false, 'All looks lost for the Rebellion against the Empire as they learn of the existence of a new super weapon, the Death Star. Once a possible weakness in its construction is uncovered, the Rebel Alliance must set out on a desperate mission to steal the plans for the Death Star. The future of the entire galaxy now rests upon its success.', 7.8, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('ed14d2c4-b655-4a48-a2bb-19550429ba9d', 'Star Trek Into Darkness', false, 'When the USS Enterprise crew is called back home, they find an unstoppable force of terror from within their own organization has detonated the fleet and everything it stands for, leaving our world in a state of crisis. With a personal score to settle, Captain Kirk leads a manhunt to a war-zone world to capture a one-man weapon of mass destruction. As our space heroes are propelled into an epic chess game of life and death, love will be challenged, friendships will be torn apart, and sacrifices must be made for the only family Kirk has left: his crew.', 7.7, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('45a132ac-e940-4f02-bffe-b2664460d920', 'Star Wars: Episode IX - The Rise of Skywalker', false, 'The surviving members of the resistance face the First Order once again, and the legendary conflict between the Jedi and the Sith reaches its peak bringing the Skywalker saga to its end.', 6.7, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('8e827ea5-175a-4dea-aad8-ac9cf4ba7eca', 'A Star Is Born', false, 'Jackson Maine (Cooper), a country music star on the brink of decline, discovers a talented unknown named Ally (Germanotta). As the two begin a passionate love affair, Jackson coaxes Ally into the spotlight, catapulting her to stardom. But as Ally''s career quickly eclipses his own, Jack finds it increasingly hard to handle his fading glory.', 7.7, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('41408f3d-aa2d-4d14-8102-74edd6b13ec3', 'Solo: A Star Wars Story', false, 'During an adventure into the criminal underworld, Han Solo meets his future co-pilot Chewbacca and encounters Lando Calrissian years before joining the Rebellion.', 6.9, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('9954dd88-7df6-49c6-97c5-1a6b241a3c9c', 'Star Trek Beyond', false, 'After stopping off at Starbase Yorktown, a remote outpost on the fringes of Federation space, the USS Enterprise, halfway into their five-year mission, is destroyed by an unstoppable wave of unknown aliens. With the crew stranded on an unknown planet and with no apparent means of rescue, they find themselves fighting against a ruthless enemy with a well-earned hatred of the Federation and everything it stands for. Only a rebellious alien warrior can help them reunite and leave the planet to stop this deadly menace from beginning a possible galactic war.', 7.1, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('6febad72-6243-4307-b8a6-d2eb09c003c4', 'Star Trek: First Contact', false, 'In the 24th century, the crew of the Enterprise-E has been ordered to patrol the Romulan Neutral Zone by the Federation to avoid interference with their battle against the insidious Borg. Witnessing the loss of the battle, Captain Jean-Luc Picard ignores orders and takes command of the fleet engaging the Borg. But the Borg plan to travel back into the 21st century through a vortex with the intention to stop Earth''s first contact with an alien race (the Vulcans). Following the Borg sphere, Picard and his crew realize that they have taken over the Enterprise in order to carry out their mission. Their only chance to do away with the Borg and their seductive queen is to make sure that Zefram Cochrane makes his famous faster-than-light travel to the stars.', 7.6, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('8447f64b-0a05-4d4d-9e6b-4265e737b057', 'Star Trek II: The Wrath of Khan', false, 'It is the 23rd century. Admiral James T. Kirk is an instructor at Starfleet Academy and feeling old; the prospect of attending his ship, the USS Enterprise--now a training ship--on a two-week cadet cruise does not make him feel any younger. But the training cruise becomes a deadly serious mission when his nemesis Khan Noonien Singh--infamous conqueror from late 20th century Earth--appears after years of exile. Khan later revealed that the planet Ceti Alpha VI exploded, and shifted the orbit of the fifth planet as a Mars-like haven. He begins capturing Project Genesis, a top secret device holding the power of creation itself, and schemes the utter destruction of Kirk.', 7.7, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('8e76bbb8-8a60-40e6-bca2-2b8b625f240f', 'Star Trek: The Next Generation', false, 'Set in the 24th century and decades after the adventures of the original crew of the starship Enterprise, this new series is the long-awaited successor to the original Star Trek (1966). Under the command of Captain Jean-Luc Picard, the all new Enterprise NCC 1701-D travels out to distant planets to seek out new life and to boldly go where no one has gone before.', 8.6, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('04052713-c8f7-4cc3-996a-8ac0b414c72a', 'Star Trek: Discovery', false, 'Ten years before Kirk, Spock, and the Enterprise, the USS Discovery discovers new worlds and lifeforms as one Starfleet officer learns to understand all things alien.', 7.3, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('190f3441-ecdd-42c9-b471-358868c634c4', 'Star Trek', false, 'A massive alien spacecraft of enormous power destroys three powerful Klingon cruisers, entering Federation space. Admiral James T. Kirk is ordered to take command of the USS Enterprise for the first time since her historic five-year mission. The Epsilon IX space station alerts the Federation, but they are also destroyed by the alien spacecraft. The only starship in range is the Enterprise--after undergoing a major overhaul at Spacedock on Earth. Kirk rounds up the rest of his crew, and acquires some new members, and sets off to intercept the alien spacecraft. However, it has been there years since Kirk last commanded the Enterprise... is he up to the task of saving Earth?', 6.4, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('d7564a49-8b14-4433-a40b-b8812d19da69', 'Star Trek IV: The Voyage Home', false, 'The most acclaimed Star Trek adventure of all time with an important message. It is the 23rd century, and a mysterious alien probe is threatening Earth by evaporating the oceans and destroying the atmosphere. In their frantic attempt to save mankind, Admiral Kirk and his crew must time travel back to 1986 San Francisco where they find a world of punk, pizza and exact-change buses that are as alien to them as anything they have ever encountered in the far-off reaches of the galaxy. William Shatner and Leonard Nimoy return as Kirk and Spock, along with the entire Star Trek crew.', 7.3, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('8ba7190e-62a5-44d9-9fc9-126c987f31e9', 'Star Trek: Generations', false, 'In the late 23rd century, the gala maiden voyage of the newly-christened Enterprise-B boasts such luminaries as Pavel Chekov, Montgomery Scott and the legendary Captain James T. Kirk as guests. But her maiden voyage turns into a disaster as the unprepared starship is forced to rescue two transport ships from a mysterious energy ribbon. The Enterprise manages to save a handful of the ships'' passengers and barely succeeds out intact... but at the cost of Captain Kirk''s life. 78 years later, Captain Jean-Luc Picard and the Enterprise-D crew find themselves at odds with renegade scientist Dr. Tolian Soran... who is destroying entire star systems. Only one man can help Picard stop Soran''s scheme... and he has been dead for 78 years.', 6.6, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('8ca99ba4-a0b4-493c-a1ac-6241776ec471', 'Star Trek III: The Search for Spock', true, 'In the wake of Spock''s ultimate deed of sacrifice, Admiral Kirk and the Enterprise crew return to Earth for some essential repairs to their ship. When they arrive at Spacedock, they are shocked to discover that the Enterprise is to be decommissioned. Even worse, Dr. McCoy begins acting strangely and Scotty has been reassigned to another ship. Kirk is forced to steal back the Enterprise and head across space to the Genesis Planet to save Spock and bring him to Vulcan. Unknown to them, the Klingons are planning to steal the secrets of the Genesis Device for their own deadly purpose.', 6.7, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('734cef27-4ed0-4fc4-9400-7fe0ad935092', 'Star Trek: Nemesis', false, 'After a joyous wedding between William Riker and Deanna Troi, Captain Picard and the Enterprise crew stumble upon a mysterious signal which results in it being a prototype android who is the twin to Data. Then the Enterprise is invited to Romulus to negotiate peace with the Romulans by their new Praetor named Shinzon. However, Shinzon is revealed to be a clone of Picard who was raised on Remus, a slave planet to the Romulans. Later on, Picard discovers that this peace treaty was nothing more than a set-up due to the fact that Shinzon needs Picard in order to survive. But little do the Enterprise crew know that Shinzon also plans to do away with the Federation by unleashing a weapon that could destroy a whole planet.', 6.4, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('d0a6ca25-317c-4270-b75c-af1b155b9a79', 'Star Trek: The Original Series', false, 'The adventures of the USS Enterprise, representing the United Federation of Planets on a five-year mission in outer space to explore new worlds, seek new life and new civilizations, and to boldly go where no one has gone before. The Enterprise is commanded by handsome and brash Captain James T. Kirk. His First Officer and best friend is Mr. Spock from the planet Vulcan, and Kirk''s Medical Officer is Dr. Leonard "Bones" McCoy. With a crew of approximately 430, the Enterprise battles aliens, megalomaniacal computers, time paradoxes, psychotic murderers, and even Khan!', 8.3, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('218a6c83-c9cc-471e-8ca3-e2e7665293ac', 'Star Trek: Insurrection', false, 'While on a mission to observe the peaceful Ba''ku race, Lt. Commander Data suddenly behaves as if having to fear for his existence. The immortal Ba''ku, whose planet offers regenerative radiation and therefore incredible lifespans, live in harmony with nature and reject advanced technology. Their planet and their culture is secretly researched by the Federation associated with an alien race called the Son''a. But the Son''a intend to abduct the Ba''ku in order to take the planet for themselves and for the Starfleet officials who all would like to regenerate their bodies. But they did not think of the loyalty of Captain Jean-Luc Picard and the crew of the Enterprise-E to the Prime Directive.', 6.4, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('ccc53aaa-9a0b-42f2-a927-821600d85b75', 'Star Trek VI: The Undiscovered Country', false, 'After an explosion on their moon, the Klingons have an estimated 50 years before their ozone layer is completely depleted, and they all die. They have only one choice - to make peace with the Federation, which will mean an end to 70 years of conflict. Captain James T. Kirk and crew are called upon to help in the negotiations because of their experience with the Klingons. Peace talks don''t quite proceed, and Kirk and McCoy are convicted of assassinating the Klingon High Chancellor, and imprisoned on Rura Penthe, a snowy hard-labor prison camp. Will they manage to escape? And will there ever be peace with the Klingons?', 7.2, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('961b59fc-799c-4fc4-be2e-c5acc98ea9cb', 'Star Trek: Voyager', false, 'The Federation starship USS Voyager, chasing a band of Maquis rebels, enters the dangerous space nebula known as the Badlands. Both ships are transported by a distant space probe to the Delta Quadrant, 75,000 light-years from Federation space. Voyager''s crew and the Maquis form an uneasy truce to rescue crewmen of both ships, kidnapped by the probe''s builder, the powerful, dying Caretaker. The Maquis ship is destroyed in a battle with the warlike Kazons. To prevent a Kazon aggression against a helpless world, Voyager destroys the space probe. Without the probe, it will take 75 years for Voyager to travel back to Federation space. With the differences between them rendered meaningless by time and distance, The Federation and Maquis crews unite aboard Voyager. Together, they embark on their new mission: to boldly go - home.', 7.8, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('0e9251e9-5b03-40f2-b649-d4b1b8d0f779', 'Star Trek V: The Final Frontier', false, 'When the newly-christened starship Enterprise''s shakedown cruise goes poorly, Captain Kirk and crew put her into Spacedock for repairs. But an urgent mission interrupts their Earth-bound shore leave. A renegade Vulcan named Sybok has taken three ambassadors hostage on Nimbus III, the Planet of Galactic Peace. This event also attracts the attention of a Klingon captain who wants to make a name for himself and sets out to pursue the Enterprise. Sybok''s ragtag army captures the Enterprise and takes her on a journey to the center of the galaxy in search of the Supreme Being.', 5.5, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('dfd8c8ec-1acf-4da7-be99-2512e4c87a9f', 'Star Wars: The Clone Wars', false, 'As the Clone Wars sweep through the galaxy, the heroic Jedi Knights struggle to maintain order and restore peace. More and more systems are falling prey to the forces of the dark side as the Galactic Republic slips further and further under the sway of the Separatists and their never-ending droid army. Anakin Skywalker and his Padawan learner Ahsoka Tano find themselves on a mission with far-reaching consequences, one that brings them face-to-face with crime lord Jabba the Hutt. But Count Dooku and his sinister agents, including the nefarious Asajj Ventress, will stop at nothing to ensure that Anakin and Ahsoka fail at their quest. Meanwhile, on the front lines of the Clone Wars, Obi-Wan Kenobi and Master Yoda lead the massive clone army in a valiant effort to resist the forces of the dark side ...', 5.9, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('310c2724-f526-43bf-bbbe-52d38b668d78', 'Star Wars: The Clone Wars', false, 'Jedi Knights lead the Grand Army of the Republic against the droid army of the Separatists.', 8.2, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('68590017-1bb1-4cb4-bff2-b2e906e070e1', 'Star Trek: Deep Space Nine', false, 'The stable wormhole discovered by the Deep Space Nine crew is known to the Bajoran people as the Celestial Temple of their Prophets. Sisko, as discoverer of the wormhole and its inhabitants, is therefore the Emissary of Bajoran prophesy. The wormhole''s other end is in the Gamma Quadrant, halfway around the galaxy from Bajor. That section of space is dominated by the malevolent Dominion. The Dominion is led by the Changelings, the race of shapeshifters to which Odo belongs. As of the beginning of the sixth season, Cardassia has joined the Dominion, and together they are waging war on the Federation and their Klingon allies. The war is quickly becoming the most costly war ever for the Federation, and the Deep Space Nine crew must fight to protect their way of life.', 7.9, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('ab2bd48f-5123-4062-894d-ed20f2d27a6c', 'Star Trek: Enterprise', false, 'The year is 2151. Earth has spent the last 88 years since learning how to travel faster than the speed of light studying under the wisdom of their alien ally called the ''Vulcans''. Now, the first crew of human explorers sets out into deep space on a ship called the ''Enterprise'' to see what is beyond our solar system.', 7.5, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('85c72e4c-9687-4fcc-aff8-980c00e7b5d4', 'Rock Star', false, 'Chris Cole was born to rock. His longtime girlfriend Emily believes his talent could take him all the way - but Chris worships at the altar of Bobby Beers, the fiery frontman for heavy metal legends Steel Dragon. By day, Chris still lives at home with his parents and spends his days repairing copy machines. But when Chris takes the stage, fronting Pennsylvania''s premiere Steel Dragon tribute band, all of that disappears. Chris Cole is Bobby Beers - mesmerizing audiences with his perfect imitation of Beers'' electrifying vocals. The night his bandmates boot him out of the group, Chris is devastated - until an unexpected phone call changes his life forever: He, Chris Cole, has been tapped to replace Bobby Beers as the lead singer of Steel Dragon. In an instant, Chris rockets to the dizzying heights of sudden stardom, rising from devotee to icon, from rock fan to rock god - the wanna-be who got to be. So what happens when an average guy gets everything he wants - and discovers it''s not enough?', 6.3, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('42eafce5-7413-4f80-a16f-5ec3f4a98f94', 'Star Trek: Picard', false, 'Follow-up series to Star Trek: The Next Generation (1987) and Star Trek: Nemesis (2002) that centers on Jean-Luc Picard (Sir Patrick Stewart) in the next chapter of his life.', 7.7, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('6426677b-6d26-4372-a8ac-0f92f294b293', 'Lone Star', true, 'John Sayles'' murder-mystery explores interpersonal and interracial tensions in Rio County, Texas. Sam Deeds is the local sheriff who is called to investigate a 40-year-old skeleton found in the desert....As Sam delves deeper into the town''s dark secrets, he begins to learn more about his father, the legendary former sheriff Buddy Deeds, who replaced the corrupt Charlie Wade. While Sam puzzles out the long-past events surrounding the mystery corpse, he also longs to rekindle a romance with his old high-school flame. Sayles'' complex characters are brought together as the tightly woven plot finally draws to its dramatic close.', 7.4, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('c0ac80b8-9db8-491c-a624-28ed25f84bdc', 'Star Wars Rebels', true, 'An animated TV series set between the events of Episode III and IV, Star Wars Rebels takes place in a time where the Empire is securing its grip on the galaxy and hunting down the last of the Jedi Knights as a fledgling rebellion against the Empire is taking shape.', 8, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('70ce1f5d-f3dc-4d0c-8a92-f3d71adee3f0', 'A Star Is Born', false, 'Esther Blodgett is just another starry-eyed farm kid trying to break into the movies. Waitressing at a Hollywood party, she catches the eye of alcoholic star Norman Maine, is given a test, and is caught up in the Hollywood glamor machine (ruthlessly satirized). She and her idol Norman marry; but his career abruptly dwindles to nothing', 7.3, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('451b0b37-a0e5-4255-8dd7-19a730a6ac6f', 'Voices of a Distant Star', false, 'The story of the high school students Mikako Nagamine and Noboru Terao. When the alien Tarsians attack, Mikako volunteers to be a pilot in the space force that will protect mankind. The lovers try to remain in contact using cellular telephone text messages, but as each battle takes Mikako further from the Earth, each message takes longer to arrive. Will their love stand the tests of time and distance?', 7.2, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('1551aeb7-2356-4c7b-9ba0-4a81f0d6eb0c', 'Robot Chicken: Star Wars', false, 'The first of three Star Wars themed Robot Chicken parodies.', 8.1, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('17b7ffee-509a-44b0-8ac1-73e1e05341d5', 'Bright Star', true, 'It''s 1818 in Hampstead Village on the outskirts of London. Poet Charles Brown lives in one half of a house, the Dilkes family who live in the other half. Through their association with the Dilkes, the fatherless Brawne family know Mr. Brown. The Brawne''s eldest daughter, Fanny Brawne, and Mr. Brown don''t like each other. She thinks he''s arrogant and rude, and he feels that she is pretentious, knowing only how to sew (admittedly well as she makes all her own fashionable clothes), flirt and give opinions on subjects about which she knows nothing. Insecure struggling poet John Keats comes to live with his friend, Mr. Brown. Miss Brawne and Mr. Keats have a mutual attraction to each other, a relationship which however is slow to develop in part since Mr. Brown does whatever he can to keep the two apart. But other obstacles face the couple, including their eventual overwhelming passion for each other clouding their view of what the other does, Mr. Keats'' struggling career which offers him little in the way of monetary security (which will lead to Mrs. Brawne not giving consent for them to marry), and health issues which had earlier taken the life of Mr. Keats'' brother, Tom.', 6.9, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('69f7b334-4030-400f-8c31-2a6d94b68881', 'Star Wars: Clone Wars', false, 'Immediately after the events of Star Wars: Episode II - Attack of the Clones (2002), the Clone Wars continue. The Separatists launch masses of Battle Droids while the Republic has an entire arsenal of Clone Troopers to blow them away. Obi-Wan Kenobi and his apprentice Anakin Skywalker are also participating in the fights against Count Dooku and his defiant separatists. Jedi Masters Yoda and Mace Windu, take part in the battle as well. While down on Coruscant, Padm√© Amidala, Chancellor Palpatine, C-3PO and R2-D2 hope nothing but good for our heroes. Will the Republic emerge triumphant? Will Dooku and his separatists be brought to their knees? And will Anakin truly bring balance to the Force, or will he bring absolutely tyranny?', 7.8, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('1364a74e-bfca-496a-ad66-01b531740c50', 'Dark Star', true, 'Low-budget story of four astronauts in deep space, whose mission is to destroy unstable planets in star systems which are to be colonised. The late Commander Powell is stored in deep freeze, where he is still able to offer advice. As their mission nears completion, they must cope with a runaway alien which resembles a beach-ball, faulty computer systems, and a "smart bomb" who thinks it is God.', 6.3, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('0261e772-26cb-4eb7-a103-7c702e601946', 'Star-Crossed', false, 'What starts out as a star crossed lovers story gradually changes focus to explore moral conflicts with integration and racism Both humans and aliens feel like they are the superior race so they fight each other to try to achieve the most power. The seven aliens and their families help each other out and take great risks to ensure their survival.', 7.3, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('b4232798-c04e-4d40-a4aa-a5d341fb42bd', 'A Star Is Born', false, 'Norman Maine, a movie star whose career is on the wane, meets showgirl Esther Blodgett when he drunkenly stumbles into her act one night. A friendship develops, then blossoms into romance before tensions increase as Esther''s career takes off while Norman''s continues to plummet.', 7.6, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('9d993b44-4d59-47db-9c56-c181c0c9d345', 'Dickie Roberts: Former Child Star', false, 'Once, he was on top of the world as a popular child actor on TV. Now, he''s Hollywood''s punchline about everything wrong with people who were famous as children. All Dickie Roberts wants to do is find that one gig that will restore his honor and everyone''s love of him, so after learning that Rob Reiner''s making an ambitious new movie destined to sweep the Oscars, Dickie''s first in line to audition. He walks out having learned he certainly looks the part but can''t act it... yet, owing to his very unusual childhood. To research the role, Dickie embarks on a bizarre scheme to live with a suburban family to see how the average American child lives, having them put him up as their "son". But once his gloves are off, Dickie discovers how great it is to be part of a true family, and whether he gets the part or not, his attempt at method acting will certainly change his life forever.', 5.5, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('f61092a7-27b4-448d-96ab-cde3dd8c11a0', 'All-Star Superman', false, 'While saving the crew of the first manned mission to the sun, Superman is poisoned by solar radiation. Dying, he decides to fulfill his lifelong dreams, while still saving the Earth from various threats. But when Lex Luthor reveals his latest plot to control the world, Superman must use his remaining strength to stop him.', 7, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('acdf17d3-f2fc-4b0e-ab36-f2d3f0582c86', 'The Star Wars Holiday Special', false, 'It is Life Day, a holiday that is celebrated on Chewbacca''s home planet Kashyyyk. Chewie and Han Solo are trying to get to the planet where Chewie''s family is waiting for him, but the Empire is out searching for the Rebels, giving everyone a hard time. While we are waiting we get a look at the everyday life of a Wookiee family. We meet all the familiar characters from Star Wars: Episode IV - A New Hope (1977) and we are introduced to Boba Fett during a short cartoon. We also pay a visit to the Cantina and meet all the monsters again.', 2.1, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('f2f39d94-3fed-41be-9327-169be23e8868', 'Bucky Larson: Born to Be a Star', false, 'Living in small town Iowa, Bucky Larson is a simple minded, uneducated, beaver toothed young man still living with his protective parents, Jeremiah and Debbie Larson. Initially saddened when he is fired from his job as a bagger at a supermarket, he eventually sees it as a sign that he is destined for greatness in some other field. Based on some information he learns, Bucky believes that destiny is to become a porn star, despite he being a virgin and only having recently learned what masturbation is. With his parents'' blessing, Bucky hops on a bus to Los Angeles to make it big there as a porn star. He is taken under the wings of a few people in LA. On the professional side, he meets the reigning king of porn, Dick Shadow, who only sees in Bucky a laughing stock. But washed up porn director Miles Deep stumbles across what he sees as an untapped niche market for Bucky''s limited talents. Miles has the challenge of trying to convince investors who only see in Bucky the antithesis of porn. On the personal side, Bucky befriends a young diner waitress Kathy McGee, who helps Bucky find a place to live - albeit with an insensitive oaf named Gary who only wants to get into Kathy''s pants - and navigate general life in the big city. Kathy, however, is facing her own demons in working toward her destiny, those demons which Bucky hopes he can help her beat down.', 3.2, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('1e2b88ff-f226-414c-bd6d-e51c9a452a95', 'Tin Star', false, 'Ex undercover UK cop turned police chief of a small town in the Canadian Rockies does what he must to defend his family from those in power whether it''s the oilmen, the preachers or the gangsters.', 7.3, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('11bb10e8-8b9f-4f71-8e73-bef15baba88f', 'Star vs. the Forces of Evil', false, 'An interdimensional princess, from the kingdom of Mewni, named Star Butterfly is sent to a new dimension, the Earth dimension, to learn how to use her newest possession, the royal family wand, and she finds help along the way meeting an Earth boy named Marco Diaz, and she lives with Marco and his parents causing all kinds of interdimensional mischief.', 8, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('b9eb25f7-853d-454c-8fea-8a1919963ce6', 'A Star Is Born', false, 'Talented rock star John Norman Howard has seen his career begin to decline. Too many years of concerts and managers and life on the road have made him cynical and the monotony has taken its toll. Then he meets the innocent, pure and very talented singer Esther Hoffman. As one of his songs in the movie says "I''m gonna take you girl, I''m gonna show you how." And he does. He shows Esther the way to stardom while forsaking his own career. As they fall in love, her success only makes his decline even more apparent.', 6.2, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('37060f11-32bf-429d-9c42-a4f4c06fd906', 'My Love from Another Star', false, 'Do Min-Joon, an alien that came to our planet 400 years ago, will be able to return to his planet in 3 months, but when he meets famous actress Chun Song-Yi, all the centuries he spent distancing himself from humans come to an end.', 8.3, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('a58e7bd1-24e5-4533-ac4d-bd44c88e368b', 'Star', false, 'The Driver now carries an arrogant rock star who is visiting a major city (not Pittsburgh as earlier believed). Played by Madonna, this title character wants to get away from her bodyguards in the Driver''s BMW. He soon gets tired of her and decides to have a bit of fun.', 7.7, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('e453c479-58a3-4684-b1f3-fa48ba77d426', 'Wish Upon a Star', false, 'Handsome, considerate high-school jock Kyle Harding is the only taste the Wheaton sisters share. Tall, fashionable, popular airhead big sister is dating him, but fails to truly appreciate the young gentleman, let alone contemplate a serious relationship. Nerdy kid sister Haley hates the waste and expresses her envy by thoughtlessly wishing at a ''shooting star'' (comet) to be Alexia. To their stupor, that happens the next morning. Forced to live each-other''s lives, but unable to do it well by the other''s standards, the sisters soon hate each-other even more and deliberately screw up. Gradually, they realize they would only both lose out, learn to appreciate the other''s values and reconsider their own. Remain the matters of obviously utterly confused Kyle, and new neighbor boy Simon, whose no longer secret crush on Haley was confounded by Alexia.', 6.7, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('cc085e24-fa53-4e77-aad6-407a08f5d830', 'Third Star', false, 'James and his three closest lifelong friends go on an ill-advised trip to the stunning coastal area of Barafundle Bay in West Wales. What follows is a touching and comical adventure dealing with friendship, heroism and love.', 7.5, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('29a82f26-acbe-422f-bce5-54fda6c435c9', 'The Star Chamber', false, 'Disgusted with criminals escaping the judicial system via technicalities, an idealistic young judge investigates an alternative method for punishing the guilty.', 6.3, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('f4c41105-bcd1-4fde-a697-bdde4dd74a3a', 'The Star', false, 'In Sony Pictures Animation''s THE STAR, a small but brave donkey named Bo yearns for a life beyond his daily grind at the village mill. One day he finds the courage to break free, and finally goes on the adventure of his dreams. On his journey, he teams up with Ruth, a lovable sheep who has lost her flock and Dave, a dove with lofty aspirations. Along with three wisecracking camels and some eccentric stable animals, Bo and his new friends follow the Star and become accidental heroes in the greatest story ever told - the first Christmas.', 6.2, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('e25e46a7-10e3-46ab-b26b-8db2e5a35b7a', 'Fist of the North Star', false, 'After a nuclear holocaust tears the world apart, mankind is forced to the harshness of not only the oppression of others who are much more powerful, but the dead earth which seems to be getting worse with every passing moment. But a savior has risen from the ashes, a man who will defeat those who would torment the weak and make the world a livable place once more. A man named Kenshiro.....', 7.3, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('bc9e6775-119a-4f4a-afc3-5b5221c576f8', 'Star Wreck: In the Pirkinning', false, 'The future looks bleak for Captain Pirk. Originally from the far future, he traveled back to save the world, but was shipwrecked on the 21st century. The world of the past is a dangerous place and he is finding it difficult to convince the ladies he is, in fact, an intergalactic space hero from the future. To make things right Pirk comes up with a questionable plan to save mankind''s future...', 6.6, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('047fb9cd-36f5-4c09-b9b4-ab97f0ddb38f', 'Star Trek: The Animated Series', false, 'This animated series continues the adventures of the USS Enterprise, taking advantage of the visual freedom of animation to present stories with more alien elements.', 7.5, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('adcb8f94-5bba-41d0-8c58-05580030df34', 'Star 80', false, 'Paul Snider is a narcissistic, small time hustler who fancies himself a ladies man. His life changes when he meets Dorothy Stratten working behind the counter of a Dairy Queen. Dorothy is a pretty but naive high school senior. Paul immediately falls for Dorothy, who sees in Paul a wise, worldly person unlike herself. Paul believes Dorothy is Playboy material, the magazine he sees as only a springboard to bigger and better things. Paul''s dream does become a reality: not only does Dorothy eventually marry him, she becomes the August 1979 Playboy Playmate and ultimately Playboy Playmate of 1979, which does indeed lead to the start of an acting career. As Dorothy''s star rises, Paul''s life is one of a hanger-on as those in Dorothy''s new circle, including Playboy publisher Hugh M. Hefner and movie director Aram Nicholas, don''t much like Paul. Paul is unable to eke out a life of his own without using Dorothy''s name, which she increasingly is reluctant to provide to her husband. Those that know the couple know their relationship cannot continue as is, and it''s only a matter of how it will change or end is the question.', 6.7, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('ca2b22a7-7608-4317-a875-987dcf10dcec', 'Star Wars: Knights of the Old Republic', true, 'Four thousand years before the fall of the Republic, before the fall of the Jedi, a great war was fought, between the armies of the Sith and the forces of the Republic. A warrior is chosen to rescue a Jedi with a power important to the cause of the Republic, but in the end, will the warrior fight for the Light Side of the Force, or succumb to the Darkness?', 9.6, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('fde66382-0851-4d0e-ac98-03a02928d7f7', 'The Star Maker', true, '"Dottore" Joe Moretti travels round Sicily doing screen tests for the big Roman studios. He''s a conman and takes money or favours for his efforts. Beata, a young illiterate convent girl desperately wants to change her life and falls for him, belatedly he realises his feelings for her. Their love affair is doomed when he''s arrested.', 7.4, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('1b6ef50c-954f-492d-b652-80ad91b0b33c', 'The Sun Is Also a Star', true, 'A hopeless romantic ambivalent about his future in medical school falls for a hard-luck young woman who doesn''t believe in love.', 5.8, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('22fb1def-a540-48f0-b03c-6a7b0f28a1a6', 'The Tin Star', false, 'Veteran bounty-hunter Morg Hickman rides into a town in danger. The sheriff has been killed, and young inexperienced Ben Owens named a temporary replacement until a permanent can be found. Ben wants to be that permanent replacement, so needs to impress the townspeople with his skill. When he finds that Morg was a sheriff for a long time before he became a bounty-hunter, he asks the older man to teach him. Morg thinks that being a sheriff is a foolish goal, but agrees to instruct Ben in handling people, more important to a sheriff than handling a gun.', 7.4, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('e54772a8-4a33-4f91-ae53-67c9dcd43fad', 'Robot Chicken: Star Wars Episode II', false, 'The second of three Star Wars themed Robot Chicken parodies.', 8.1, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('1f0d01cb-1c2e-4fe0-8e0a-45b2194cf61e', 'Star Wars: The Force Unleashed', false, 'Darth Vader''s secret apprentice, codenamed Starkiller, is trained in the Dark Side to defeat the enemies of the Empire, but must find his own path when his master betrays him.', 8.2, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('99f26cd5-8bf8-470e-ac4c-2e6df61d0ce5', 'Fullmetal Alchemist: The Sacred Star of Milos', false, 'In the lost holy land of Milos, the Elrics search for the truth behind an unknown form of alchemy. What secrets are hidden in Milos? Riddles must be solved and dangers faced before the truth can be found.', 7, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('5775483b-6eb5-4b30-8faa-925eed53226f', 'Star Wars: Battlefront II', false, 'You play as a member of the Clone 501st Legion, the most elite clone trooper attack group, also known as Vader''s Fist, and led by Anakin Skywalker/Darth Vader, over the course of the start, the middle, and the end of the Clone Wars, Operation Knightfall, and the key battles of the Galactic Civil War.', 8.8, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('a2453914-b9b9-418e-b54f-755a69880f37', 'Star Spangled Girl', false, 'A pair of 60''s hippies fall in love with the girl next door, who is exactly the kind of square that they are fighting against.', 5.5, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('45501206-ecb0-40b3-a550-e6e4f71b2b09', 'Robot Chicken: Star Wars III', false, 'The Emmy Award-winning Robot Chicken returns with its third send-up of the Star Wars universe! In this all-new hour-long special, four very different characters -- Emperor Palpatine, Darth Vader, Boba Fett and Gary the Stormtrooper -- reveal untold stories that weave and interconnect throughout all six Star Wars films! Set phasers to "fun"! Oh wait, that''s the wrong franchise.', 8.1, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('3f6272b8-7663-49cf-be1b-2f780cb696aa', '9-1-1: Lone Star', false, 'A New York firefighter relocates to Austin, Texas with his son, where he works to save people''s lives while trying to solve his own personal problems.', 6.3, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('7f96d1b8-2ad1-4f47-ae4a-7b0de24dbb92', 'The Evening Star', false, 'Continuing the story of Aurora Greenway in her latter years. After the death of her daughter, Aurora struggled to keep her family together, but has one grandson in jail, a rebellious granddaughter, and another grandson living just above the poverty line.', 5.9, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('366bec7b-9990-4e71-8b8e-247228c9931a', 'Buzz Lightyear of Star Command: The Adventure Begins', false, 'After a successful mission in which his partner, Warp Darkmatter, fell in battle, Buzz Lightyear vows never to put another partner at risk and works solo. This vow, however is challenged by Star Command who assigns young Mira Nova to be Warp''s replacement over Buzz''s objections. In addition, the LGMs suggest he tries a new robot for an assistant while a lowly janitor, Booster, has his dreams of joining the Space Rangers. Together, this group of disparate heroes find they must work together to save the galaxy when Emporer Zurg hatches his grandest scheme for conquest yet.', 6.2, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('5be8b852-dd23-4c6a-9bc9-ce33ec8cf9ce', 'Empire of Dreams: The Story of the ''Star Wars'' Trilogy', false, 'This documentary chronicles the making of the original Star Wars trilogy from start to finish. We get some background on George Lucas'' start in the business and then continue with the making of Star Wars (1977), Star Wars: Episode V - The Empire Strikes Back (1980) and Star Wars: Episode VI - Return of the Jedi (1983). The visual/special effects and financial problems are explained as well as casting, editing, scoring and releasing the films with tons of archival footage and interviews with plenty of cast & crew members.', 8.3, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('4cd3fd0d-b41b-4f79-b9ad-71591899c6d2', 'Star', false, 'A trio of women form a musical group in Atlanta.', 6.6, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('7a782966-4f4e-4502-b0d4-5d18fdd83315', 'Star Wars Jedi: Fallen Order', false, 'Set shortly after Revenge of the Sith, the player takes on the role of a Jedi padawan being hunted by the Empire after Order 66.', 8.8, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('4140b16b-f239-4997-9f09-fe5f6600e78b', 'Star Wars Resistance', false, 'Kazuda Xiono, a young pilot for the Resistance, is tasked with a top secret mission to investigate the First Order, a growing threat in the galaxy.', 4.9, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('208eeef8-c3fd-4331-8b7c-abeaa0205be1', 'Star Trek: Renegades', false, 'When a seemingly unstoppable new enemy threatens the very existence of the Earth, Admiral Pavel Chekov (Walter Koenig) is forced to work outside the boundaries of Starfleet''s rules to combat this deadly new foe. When planet after planet winks out of existence, yet Starfleet refuses to act, Chekov turns to Commander Tuvok (Tim Russ, who also directs), the new head of Starfleet''s covert operations division, Section 31. Together, they assemble a new elite strike-force, consisting of rogues, outcasts and criminals, led by the fearless yet haunted Lexxa Singh (Adrienne Wilkinson). The Renegades'' mission is simple: take on an army and stop their leader, Borrada (Bruce Young), from destroying the Earth. Outnumbered and out-gunned, the ragtag crew is in an adrenaline-pumping race against time and space. But they soon find their foes are the least of their concerns: the real trouble may be coming from within!', 4.9, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('d542b2aa-fe51-4972-90cb-aeb8e4beba5b', 'Star Wars: Knights of the Old Republic II - The Sith Lords', true, 'Five years after the defeat of Darth Malak, the Sith Lords have nearly destroyed the Jedi Order. An exiled Jedi has returned only to find the galaxy in shambles, and must decide whether to follow the path of the Dark Side and participate in the destruction of the Jedi Order or the Light Side and restore the Jedis to glory.', 8.9, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('61ce1590-fc8b-406f-ac02-7b9cd13b5d83', 'Outlaw Star', false, 'Gene Starwind dreams of a life as an Outlaw, and fate smiles on him as he seems to suddenly wind up with a great job. But things go awry, and he finds himself the new owner of the fastest, most technologically advanced space ship in the galaxy. Unfortunately, it''s stolen and the owners want it back Along with his partner Jim and the lovely Melfina, Gene must fight his way across the galaxy battling pirates, aliens and assassins as he attempts to discover the secrets of the Outlaw star.', 7.9, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('3760946a-32f7-4f66-8d69-bc8734e9474e', 'The Star', false, 'Middle-aged Oscar winning actress Margaret Elliot - Maggie to those that know her - is a Hollywood has-been. Her life is in shambles. She clings to the hope of resurrecting her past movie stardom as a leading ing√©nue. No one will hire her, she''s penniless with creditors selling off anything that she owns that is of monetary value, and she has no one to turn to that can see her through financially. She has in the past supported her sister and brother-in-law, who still want to use her as their meal ticket. Divorced from her actor husband, she shares joint custody of their teen-aged daughter Gretchen, from who Maggie tries to hide her problems. When it looks as if Maggie has hit rock bottom, Jim Johannsen re-enters her life. Jim, who once had the stage name Barry Lester, got his big break in Hollywood movies by Maggie. He came to the quick realization that he was neither good as an actor or that he wanted to do it as a profession. He now works as a boat parts supplier and mechanic. Jim tries to help her come to the realization of the stage of life that she is in to help her reinvent herself. But Maggie wants to regain her star status on her own terms, and does whatever she needs to for that great ing√©nue role that has eluded her for so many years.', 7, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('f239106b-8d92-4fe2-be46-cdfcfa5d6e6e', 'The Last Movie Star', false, 'An aging former movie star is forced to face the reality that his glory days are behind him. On its surface, the film is a tale about faded fame. At its core, it''s a universal story about growing old.', 6.9, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('e2700f9b-b26e-49c4-ac79-3851cbb7030a', 'Fist of the North Star', false, 'Based on a graphic novel, this apocalyptic adventure centers on a man who must reverse the cataclysmic conditions of his world.', 3.9, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('364564af-32be-4a06-96bb-8c243d986943', 'Flaming Star', false, 'West Texas in the years after the Civil War is an uneasy meeting ground of two cultures, one white. The other native American. Elvis portrays Pacer Burton. The son of a white rancher (John McIntire) and his beautiful Kiowa Indian wife (Dolores DelRio). When fighting breaks out between the settlers and natives, Pacer tries to act as a peace maker, but the "flaming star of death" pulls him irrevocably into the deadly violence.', 6.5, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('4ce90e14-49cd-490e-a275-61abbfa0e8ab', 'Star Wars: The Force Unleashed II', false, 'A clone of Starkiller is created by Darth Vader, but, after he escapes his master''s grasp, he travels across the galaxy to discover who, or what, he really is.', 7.1, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('9f98d9a2-969c-43ac-be55-e4a574abfeb2', 'Man Without a Star', false, 'Dempsey Rae, a cowboy with no clear aim in life, winds up working on a spread with a hard lady owner just arrived from the East. She needs a tough new top hand and uses all her means of persuasion to get Rae to take the job. But he doesn''t like the way the other settlers are getting treated and starts to side with them, despite their introduction of the barbed wire he loathes.', 6.9, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('e7d8f164-c884-4ded-a64c-82a487410ea5', 'The Universe''s Star', false, 'This is the love story between gifted singer-songwriter Woo-Joo and the angel of death Byul.', 7.3, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('e6769fc4-2b02-4560-b578-78ac0db0d20b', 'Lone Star State of Mind', false, 'Earl is engaged to his step-sister Baby. Baby has entrusted him to take care of her misfit cousin Junior. Baby is also intent on leaving Texas for LA on Tuesday. When Junior and his recently released ex-con friend Tinker rob a pizza delivery boy and end up with $20,000 of drug money Earl is forced onto the scene, giving up his and Baby''s LA money to save Juniors limbs.', 6.1, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('574032bb-b235-4e06-8ce3-a945db54c48b', 'Buzz Lightyear of Star Command', false, 'The further (animated) adventures of Buzz Lightyear of "Toy Story" and "Toy Story 2." Buzz, along with fellow Star Command Rangers Mira Nova, Booster, and XR, fight to keep the universe safe from the evil clutches of Emperor Zurg and his henchman, Warp Darkmatter.', 6.7, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('34aaeddf-4549-46c7-983d-aac50dc7bce6', 'Fist of the North Star', false, 'In the year 199X, human civilization has been all but destroyed by a nuclear holocaust. In an age where the strong rule over the weak, the survivors of the fallout struggle over the remaining supply food and water left. Kenshiro, successor to an ancient, deadly martial art known as Hokuto Shinken (Fist of the North Star), wanders the wasteland with seven scars in the shape of the Big Dipper on his chest. This infamous style uses the body''s hidden 708 pressure points to destroy opponents from within and allows practitioners to unleash 100% of their humanly strength. Accompanied by a young thief and an orphan girl, this messiah brings justice to this lawless world with the strongest fist in the world.', 8.3, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('4603a948-3d49-4cfa-8e25-f4d69607c04e', 'Star Kid', false, 'Shy seventh-grader Spencer Griffith''s life changes when a meteor falls into a local junkyard and he finds a Cybersuit - an exoskeleton with AI from another galaxy. Spencer puts on the Cybersuit and becomes a different kind of person.', 5.3, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('8a9d9419-e181-4795-9b1e-60831e501f2f', 'Star Trek Continues', false, 'The USS Enterprise''s historic five-year mission continues with all new episodes of the original series. "Star Trek: Continues", a new Trek series, beams down with exciting adventures of the Federation''s most heroic crew led by Captain James T. Kirk. The lighting and color of the highly accurate sets accentuate the equally detailed props and costumes, matching the original series that ran from 1966-69! With acting and stories that also replicate the original series, the adventures are sure to dazzle even the most die hard Trek fans. Witness now the untold morality plays that explore the final frontier and more importantly... the human condition. Fans of the original series will especially enjoy the pilot episode as a familiar guest star from the original series reprises his role in a sequel entitled "Pilgrim of Eternity".', 8, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('19fc10e6-9fba-4c1d-a414-f5133a0c313a', 'Porn Star: The Legend of Ron Jeremy', false, 'Porn Star: The Legend of Ron Jeremy offers audiences a penetrating look inside the world of Ron Jeremy, America''s most unlikely sex star and hero to millions. With nearly 25 years in the adult film industry and over 1,600 films to his credit, Ron Jeremy is huge. In his world, Ron reigns supreme-he''s made millions of dollars and slept with thousands of beautiful women, and is indisputably the industry''s biggest star. And everyone who''s anyone knows Ron-a pop icon to millions, he is a beacon of hope for many American male, since he stands as living proof that pretty much anyone can get some. So how did such a classically unhandsome, big and hairy guy ever get to be such a super stud? In one of the most fascinating and entertaining comedies of the last year, audiences finally get a chance to get inside the life and times of Ron Jeremy, and find out what''s really behind the hardest working man in show business.', 6.3, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('73a35590-84cf-413d-9303-c4e30bde8570', 'A Five Star Life', false, 'Forty-something Irene had a dream job that made her life easy: she was indeed a luxury hotel inspector and her work got carried out in a wonderful ever-renewed setting, from Paris to Gstaad to Berlin to Morocco to China... But does a dream job necessarily mean a dream life? Irene tried not to ask herself the question too openly. Yes she was single but she had manged to remain on good terms with Andrea, her former life companion. For sure she was childless but she occasionally took care of her two little nieces. And it was such fun to play the mystery guest in those magnificent hotels... Things could have gone on that way hadn''t one day Irene met Kate Sherman...', 6.3, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('6b28d8f7-e18e-4628-b48c-3dd140b2ed16', 'Star Wars: Battlefront', false, 'Battlefront is a multiplayer online first-person shooter which allows players to choose from a variety of armies (Stormtroopers, Rebel pilots, AT-AT commanders, Republic Guards) and crafts (X-wings, snowspeeders and AT-STs) from the epic film series. Team up or fight head-to-head on any of ten planets. ESRB Rating: RP', 8.4, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('8bb65da3-7b08-4575-9562-d967e14954ad', 'Instant Star', false, 'Based on a song she wrote and performed, a young girl wins a national contest for a recording contract. Now she must balance the life of a normal teenager with that of a rising star in the music industry.', 7.4, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('ab684a86-7992-4f13-b865-d567dc62bdda', 'The Star', false, 'The film is based on the eponymous book by Emmanuil Kazakevich. In the summer of 1944 the Nazi Armies prepare a massive Tank Division named ''Viking" for the offensive on occupied Russian land. The Russian Army''s special group of seven snipers named "Zvezda" is sent for a reconnaissance operation behind the enemy lines in the back of the Nazi Tank Division. Two previous Russian groups never came back. The seven Russians know that they are going to an almost certain Death for the sake of Victory.', 7.1, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('e5bc4ef4-dc5e-43ff-97eb-d41d2f014708', 'Saber Rider and the Star Sheriffs', false, 'In the distant future, a team of four high tech Star Sheriffs defends frontier space colony Yuma from outlaws, as well as Outriders, an army of humanoid alien beings called Vapors, led by mysterious Nemesis, who need Yuma''s resources.', 8.4, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('22dba7a1-a5cc-4014-90a0-8e02bce94734', 'The Cloud-Capped Star', false, '"Meghe Dhaka Tara" tells the tragic story of the beautiful daughter of a middle-class refugee family from East Pakistan, living in the outskirts of Calcutta under modest circumstances. Neeta sacrifices everything for her family, including her personal happiness, her money, and her health, while her achievements are hardly ever recognized by the people around her.', 7.9, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('c55ee88e-38e6-4f44-8771-79290fbea43a', 'Star Wars: Battlefront', false, 'Join the battle and play an important part in the Star Wars Galaxy. Lead the battle as you fight against the powerful empire in hope to regain freedom for the Galaxy.', 7.1, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('8de0729a-6084-4bde-aa8d-5d94c92fcb25', 'Star Wars: Jedi Knight II - Jedi Outcast', false, 'You guide mercenary Kyle Katarn, who must stop the evil plot of a renegade Jedi by relearning his skills as a Jedi Knight.', 8.6, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('658b3093-b59c-4149-abc5-92119860bac5', 'Star!', false, 'Film based on life of actress Gertrude Lawrence, on- and offstage, takes the opportunity to feature extravagant musical production numbers with ''Julie Andrews'' , acting, singing and dancing.', 6.6, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('4caea75d-70a9-44a8-be25-a24995c3d3e6', 'Lucky Star', false, 'Having fun in school, doing homework together, cooking and eating, playing video games, watching anime. All those little things make up the daily life of the anime-and chocolate-loving-Izumi Konata and her friends. Sometimes relaxing but more than often simply funny.', 7.3, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('78bfd83d-51cc-4bd5-9567-f892254e0150', 'Star Wars: The Old Republic', false, 'Set long before the Star Wars films, the Sith Empire returns to the galaxy to begin a war with the Galactic Republic. After some brutal battles, both sides stop fighting each other, but the peace is broken and the Empire and the Republic are soon at war again.', 8.7, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('b4717352-5439-4b5f-b4c6-5493d5059e63', 'Lucky Star', false, 'An ambitious couples got in to trouble when a surrogate plan went wrong but luck comes when the baby comes to their life.', 5.4, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('d3753cdf-7bb5-47c5-b305-f3a23e2d1e3e', 'Still Star-Crossed', false, 'A period drama that picks up where the famous story of Romeo and Juliet leaves off, charting the treachery, palace intrigue, and ill-fated romances of the Montagues and Capulets in the wake of the young lovers'' tragic fate. Based on the book by Melinda Taub.', 5.5, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('bac5affe-2b9d-451a-a11b-1fb91310bff2', 'Oban Star-Racers', false, 'Earth, 2082, twenty-five years after the failed invasion of the Crog forces. Young Eva (15) is determined to be reunited with her father, race manager Don Wei, who sent her off to a tough boarding school after the tragic death of the mother, ten years earlier. She escapes from school and secretly joins her dad''s famous star-racer team under the alias "Molly". But Don Wei doesn''t recognize his daughter. He has other troubles on his mind: the President of the Earth Coalition has just put him in charge of a dangerous top-secret mission. Don Wei must lead the Earth to victory in a mysterious and mythical intergalactic competition - The Great Race of Oban. It is said that the outcome of the competition will radically transform the balance of power within our Galaxy. Earth cannot afford to lose - especially not against the Crogs! Before she knows what is happening, "Molly" takes off for the planet Alwas, the first stage of The Great Race of Oban, with Don Wei, champion pilot Rick Thunderbolt, gunner Jordan and mechanics Stan and Koji. The fate of Molly and her friends, as well as the future of the human race, are now inextricably intertwined.', 8.1, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('b7987d2d-b89d-4483-b620-e3245e580694', 'Lego Star Wars: The Padawan Menace', true, 'Ian,a young boy,Commander Cody and Yoda must go to rescue the secret battle plans.However,when substitute teacher C-3PO and a class of padawans go too,things become more complicated....', 7.2, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('d41f1916-771c-40d9-a737-be2123197e2a', 'Star Tours', false, 'Groups of visitors are taken on "Star Tours", a space tour bus set in the Star Wars universe. Thanks to an inexperienced and thoroughly incompetent robot pilot, what is billed as a leisurely tour to the Endor Moon becomes a wild ride as the tour gets caught up in a battle between the Empire and the rebels.', 8, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('37fa7722-3130-4203-b439-fd4b4cb095bf', 'Lego Star Wars: The Complete Saga', false, 'In Lego Star Wars: The Complete Saga, you can now experience all 6 episodes at once. Containing the same levels and locations. Only with newer features and improvements. Such as more extras to unlock, more vehicles to build, new playable characters, & a better customizing Lego character feature. Now all Lego & Star Wars fans alike can experience this game more than it''s successors.', 8.5, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('4843c8ba-8954-4182-9c07-ecc5fbae54f6', 'Catch a Christmas Star', false, 'With the help of his two precocious kids, a widower reconnects with his high school sweetheart, who just happens to be one of the biggest pop stars on the planet.', 6.3, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('e340e831-5b24-46f7-88b9-013ca46d4897', 'Five Star Final', true, 'Hinchcliffe, the ruthless publisher of a sleazy New York tabloid, is concerned that the ethical journalistic policies of City Editor Randall have caused a drop in circulation. He pressures the newsman to run more sensational stories including resurrecting the twenty year old Vorhees Murder Case. Although the perpetrator''s actions were ultimately judged justifiable, and she has been subsequently living an exemplary life in anonymity, Hunchcliffe insists Randall revisit the story. Randall assigns Isopod, an alcoholic degenerate, to dig up anything lurid that he find. The unprincipled reporter fraudulently insinuates himself into the Vorhees'' home masquerading as a minister and gets the expose he sought. Yellow journalism triumphs, and a decent woman''s name gets dragged through the mud again... with tragic consequences.', 7.3, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('d4a350f5-03b4-4b02-817a-4aa957b0a622', 'Star Wars: Jedi Knight - Jedi Academy', false, 'You play a young Jedi Academy student who must help stop an evil plot by Dark Jedi to collect and use Dark Side energy for their own ends.', 8.5, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('2bd1a5f6-8f6c-4613-8a2d-2412f35cfb6a', 'Dog Star Man: Part I', false, 'From a murky landscape, a wooded mountain emerges. We watch the sun. We see a bearded man climbing up the mountain through the snow. He carries an ax, and he''s accompanied by a dog. His labors continue. There is no soundtrack. Images rush past - water, trees, and surfaces too close up to distinguish. He struggles. A fire burns. Nature, in long shots and magnified, is formidable and silent. It''s tough going; he carries on. In a capillary, blood flows.', 6.3, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('811407a6-ad67-4462-bfac-f0c02912d997', 'Star Wars: Droids', false, 'This series recounts the adventures of C-3P0 and R2-D2 before they met Luke Skywalker as they serve various masters over the years. As it turns out, their lives were no less hectic as they became involved in battles versus gangsters, pirates, the Empire and even Boba Fett on one occasion.', 6.1, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('717e0e64-8550-4f24-820a-244b149c8429', 'Lucky Star', true, 'Rafael witnesses Marina - a woman with a glass eye - being attacked on the street by Daniel; her long-time acquaintance since the orphanage, where they were both raised as kids. He rescues her from Daniel and brings her to his home, where a relationship between them soon develops. Marina is pregnant, but since Daniel does not want the child, Rafael offers to step in as the father, having his own physical problems, preventing him from having kids. He and Marina stays together as a couple, and as a family. But once everything seems to be settled, Daniel - released from prison - shows up again.', 7.3, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('8effdc31-f240-4c55-af47-e558c3b7cbdb', 'Lick the Star', false, 'A clique of school girls devise a secret plan that they code-name "Lick the Star".', 6, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('f3818902-f04f-4a94-91c3-d2326fc4f1e8', 'Star Wars: Episode III - Revenge of the Sith', false, 'Game that portrays the life of a jedi knight and sith lords, while you find your way around the galaxy, as you become part of the story.', 7.3, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('16b87faa-0be4-461f-8abf-6bc951761cf1', 'Prelude: Dog Star Man', false, 'A creation myth realized in light, patterns, images superimposed, rapid cutting, and silence. A black screen, then streaks of light, then an explosion of color and squiggles and happenstance. Next, images of small circles emerge then of the Sun. Images of our Earth appear, woods, a part of a body, a nude woman perhaps giving birth. Imagery evokes movement across time.', 6.7, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('5c887959-a258-4b54-89e7-ed4972877662', 'Star Trek: Short Treks', false, 'A series of stand-alone short films featuring characters and storylines from Star Trek: Discovery (2017).', 7, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('195c6e18-65e2-4a92-af51-ed191a4fd66f', 'Big Star: Nothing Can Hurt Me', false, 'BIG STAR: NOTHING CAN HURT ME is a feature-length documentary about legendary Memphis band Big Star. While mainstream success eluded them, Big Star''s three albums have become critically lauded touchstones of the rock music canon. A seminal band in the history of alternative music, Big Star has been cited as an influence by artists including REM, The Replacements, Belle & Sebastian, Elliott Smith and Flaming Lips, to name just a few. With never-before-seen footage and photos of the band, in-depth interviews and a rousing musical tribute by the bands they inspired, BIG STAR: NOTHING CAN HURT ME is a story of artistic and musical salvation.', 7, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('1b71df14-738d-4473-9746-be19bc635ce4', 'Journey to the Christmas Star', false, 'Once upon a time a little girl went out to find the Christmas star.', 5.8, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('ab6aa2d5-8f73-4938-bc8e-d66c0e7e69ee', 'Dog Star Man: Part III', false, 'Sexual intimacy. Three kinds of images race past, superimposed on each other sometimes: two bodies, a man and a woman''s, close up, nude - patches of skin, wisps of hair, glimpses of a face and genitalia; strips of celluloid with lines and squiggles scratched on them; and, close-up shots of what appear to be the insides of living bodies - a heart beating, muscle and sinew and tissue wet with fluids. The exterior and interior of desire.', 6.5, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('cba08d14-17a6-492b-b314-670a0ed88e0e', 'Star Trek: Of Gods and Men', false, 'It is the year 2306. Thirteen years have passed since Captain James T. Kirk was swept away by the Nexus, after saving the crew of the Enterprise-B. The remaining crew members of the original USS Enterprise have gone their separate ways. Captain Nyota Uhura and Captain Pavel Chekov, along with Captain John Harriman of the Enterprise-B, come together for a special dedication in honor of Kirk''s Enterprise. Their reunion is cut short when they receive a distress call from a mysterious planet, that presses the three friends to embark on a mission that will change their lives forever.', 6.1, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('5b10fcc2-d44d-4bf0-8c6e-04321188fb35', 'Star Wars: Revelations', false, 'Seers once shaped the path of the Jedi Order. But their visions grew unreliable and the Jedi came to distrust those with the ability. Seers hid their visions or left the Order forever. In the wake of the Temple''s destruction a power struggle has emerged between Darth Vader, the Dark Lord of the Sith, and Zhanna, the Emperor''s Hand. Each seek to eliminate the last of the Jedi and gain the Emperor''s favor. Caught between them is one woman who cannot deny the truth of her visions as all race to possess an ancient Jedi secret.', 5, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('44556be5-b1c2-4d73-b12a-48b8169bca0c', 'Lego Star Wars II: The Original Trilogy', false, 'Play the original trilogy of star wars A New Hope,The Empire Strikes Back, and Return Of The Jedi. All in LEGO!!!!!!!!!', 8.4, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('bb077eb8-a6d6-4e55-9cdf-32cfe3569b2d', 'North Star', false, 'Set during the Alaskan gold rush of the late 1800''s. In his efforts to gain control of a small mining town, Sean McLennon is buying up every mining claim that becomes available, usually after the deaths of the previous owners at the hands of McLennon''s ''assistants''. One of the miners targeted by McLennon, a half-Indian hunter named Hudson Saanteek, manages to escape his hired thugs and comes back into town looking to re-establish his claim and get revenge. McLennon and his men have the advantange of numbers and weapons, but Saanteek has his survival skills and knowledge of the Alaskan wilderness.', 4.9, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('5bbf7e9f-7f0c-4432-b3f3-414954dfff72', 'Star Wars: Forces of Destiny', false, 'Small moments and everyday decisions shape a larger heroic saga.', 5, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('488735d9-ff60-4edc-9dd6-3e20e5608316', 'Food Network Star', false, 'A food network contest to find a well rounded great chef with a unique point of view and hosting type of personality to host their own show!', 6.3, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('bc154295-385e-474c-aa26-2a7f4118a77b', 'Lucky Star', false, 'Mary, a poor farm girl, meets Tim just as word comes that war has been declared. Tim enlists in the army and goes to the battlefields of Europe, where he is wounded and loses the use of his legs. Home again, Tim is visited by Mary, and they are powerfully attracted to each other; but his physical handicap prevents him from declaring his love for her. Deeper complications set in when Martin, Tim''s former sergeant and a bully, takes a shine to Mary.', 7.8, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('c855c686-2097-4b91-a444-22e6bb7c80e7', 'The North Star', false, 'In a peaceful Ukrainian village, the school year is just ending in June 1941. Five young friends set out for a walking trip to Kiev, but their travels are brutally interrupted when they are suddenly attacked by German planes, in the first wave of the Nazi assault on the Soviet Union. When the village itself is attacked and occupied, most of the men flee to the hills to form a guerrilla unit. The others resist the Nazis as well as possible, but soon the village is placed under the command of a Nazi doctor who begins using the town''s children as a source of constant blood transfusions for wounded German soldiers. Meanwhile, the small group of young persons tries desperately to take a supply of firearms to the guerrillas.', 6, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('160c6c07-c969-4bd6-ae07-af599b017b90', 'Lego Star Wars: The Video Game', false, 'Play through the star wars prequel trilogy in episodes 1,2,and 3, in lego.', 8.2, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('4be3c8a2-347d-4d51-9293-ea7c6fb8547b', 'Amateur Porn Star Killer', true, 'The unofficial story of a killer who kidnaps and kills three girls is told through the tale of his last victim, ''Amateur Porn Star Killer'' is about a girl he picks up on the street and convinces to go back to his hotel room. The girl is shy, unnerved, and yet unable to take herself out of a bad situation. The killer is a guy who seems at first nothing more than your standard, 18 year old pervert with a penchant for filming his sexual escapades. An unsettling darkness descends.', 4.3, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('37fdeaec-6650-41e8-8577-038a48c1552c', 'Lego Star Wars: The Empire Strikes Out', false, 'Luke Skywalker embarks on a mission to find and destroy an Imperial base on Naboo, but is relentlessly chased by a group of fanatic girls, who think of him as a celebrity for destroying the Death Star. Meanwhile, Darth Vader engages a "sibling" rivalry with Darth Maul, in order to prove he''s the best Sith Lord to Emperor Palpatine.', 7.3, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('163e1792-585a-4767-b3b5-f588b86ddfe2', 'Star Trek New Voyages: Phase II', true, 'These are the new voyages of the starship Enterprise. Picking up from where the original 5-year mission left-off, a new cast continues the adventures of this legendary crew: to boldly go where no human has ever gone before & to search for new life forms.', 6.7, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('597939f5-05b1-4548-89a2-6761ac54fbeb', 'Rainbow Brite and the Star Stealer', false, 'Rainbow Brite, and her magical horse Starlite, must stop an evil princess and her underlings from taking over the planet Spectra. When they meet Orin, the wise Sprite tries to make the two children get along and work together to stop the evil Princess. Orin tells them that they can only destroy her by combining their own powers against her. Getting in the way of their mission is the sinister Murky Dismal and his bumbling assistant Lurky who, as usual, are lavishing in the new gloom created by the darkening of Spectra, as well as trying to steal Rainbow''s magical color belt.', 6.9, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('8357b795-a6a3-4fb6-af20-a801a1177f2b', 'Star Blazers', false, 'In the late 2100s, the planet Gamilon, a world far beyond Earth''s solar system, declares an invasion of Earth. The nations of Earth fight as one against the Gamilons, but one by one, Earth''s fleets are defeated. When the nations of Earth refuse to surrender, Gamilon begins bombarding Earth with planet bombs, radioactive missiles that look like meteors, which gradually spread deadly radiation all over Earth, forcing what''s left of humanity to retreat to underground cities. Queen Starsha of planet Iscandar contacts Earth and promises to provide Cosmo-DNA that can remove the radioactivity and restore Earth to beautiful life. She provides plans to an engine that will allow a brave, young group of technicians to journey more than a hundred thousand light-years to Iscandar, obtain the Cosmo-DNA, and return to Earth within one Earth year. In 2199, an ancient seagoing vessel is fitted with the awesome engine and launched toward Iscandar. Along the way, the intrepid crew must fight the Gamilons, who are determined to prevent the brave voyagers from saving Earth from extinction.', 8.4, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('560b8f2d-f92e-42f2-a693-346004e7f5cf', 'Dog Star Man: Part II', false, 'A man, accompanied by a dog, struggles through snow on a mountain side. We see film stock blister; drawn square shapes appear. Then, we see an infant''s face. The images of struggling climber, baby, blurred film stock, large snow flakes, and what may be microscopic details of matter are superimposed on each other, one dominating the frame briefly to be replaced by another. As the man falls in the snow and tries to regain his feet, the baby continues to appear, first with eyes closed. Alternately, images rush by - montages of paper cutouts and life under a microscope.', 6.5, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('91b503dc-4667-4be2-a403-9a2abbefc8b2', 'Rogue One: A Star Wars Story - World Premiere', false, 'A behind the scenes look at Rogue One: A Star Wars Story.', 7.4, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('142b4f6d-1296-41f6-adba-02be9d1ea4af', 'Star Wars: Episode I - The Phantom Menace', false, 'The Jedi attempt to protect Naboo from the greedy Trade Federation and, as they soon learn, the Sith.', 6.6, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('f4d25f7f-02e0-4fb2-a81d-1aa7b179d3ca', 'Dark Star: HR Gigers Welt', false, 'He feels at home in places we would flee from and lives his life among the very things we fear. Throughout his life, HR Giger had inhabited the world of the uncanny, a dark universe on the brink of many an abyss. It was the only way this amiable, modest and humorous man was able to keep his fears in check. Giger was merely the bearer of dark messages, charting our nightmares, drafting maps of our subconscious and molding our primal fears. A film with and about the internationally acclaimed and controversial painter, sculptor, architect and designer (Oscar for ''Alien'').', 7, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('6575c15f-1b3f-4f35-ae57-f491dfa6c1df', 'Dog Star Man: Part IV', false, 'The fourth and final part of Dog Star Man (1964), an experimental film wherein a man climbs a mountain along with his dog.', 6.6, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('477ae6f6-e367-4844-ac05-6c58c21c606d', 'Star of Midnight', false, 'Friend Tim Winthrop asks criminal lawyer and amateur detective Clay Dalzell to find his girl, Alice, who disappeared a year earlier without a trace. When they go to the theater with Clay''s would-be fianc√©e, Donna Mantin, Tim recognizes the star, Mary Smith, as his girl, and yells "Alice," after which she bolts from the stage and disappears once again. Reporter Tommy Tennant knows why she bolted, but before he can tell Clay the reason, he is shot dead and Clay is wounded slightly in Clay''s apartment. The many suspects include Roger Classon and his wife, Jerry, who are looking for Alice to testify and save Roger''s friend from the electric chair for a murder he didn''t commit; Abe Ohlman, the producer of Mary''s show; and gangster Jimmy Kinland who seems to know more than he''s telling. It''s up to Clay, with the help of Donna, to trap the murderer and find Alice.', 6.7, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('9eb71471-6e00-4d47-a8c2-30bc35a96bdb', 'Star Runners', false, 'Given a undercover government mission to retrieve a "crate" from a distant planet, TY JOHNS and LEI CHEN find that they must smuggle not a crate, but a woman off world -- and when their rocket-ship crash-lands on a planet packed with vicious giant alien bugs, they''ll need all the cunning and ferocity they possess to stay alive...', 4.3, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('56ee6210-a08c-4555-8bff-bd81ae2d83c7', 'What We Left Behind: Star Trek DS9', false, 'Ira Steven Behr explores the legacy of Star Trek: Deep Space Nine (1993).', 8.4, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('5407f130-7bf6-4f8b-b78d-19e2149842cc', 'Brightest Star', false, 'After the heartbreaking end of his first love, a recent college graduate sets out to win back the girl of his dreams only to discover a greater journey awaits him.', 5.1, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('93068d8c-f51c-422a-b3db-9801de14c332', 'Afghan Star', false, '"Afghan Star" is a TV show modeled on the UK''s "Pop Idol." We join the 2008 contest when it''s down to nine contestants, and we focus on two women, Setara and Lema, and two men, Hameed and Rafi. We watch the two women in particular: Satara sings with emotion and includes dance in her final performance, an action that puts her life in danger; Lema is traditional, but her very appearance brings death threats. The three finalists are from different tribes, and each makes a plea for Afghan unity. The camera visits families watching the competition, there are comments from people in the street, and we return home with a nervous Setara. In Afghanistan, singing is an expression of freedom.', 7.3, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('26113e7d-ff11-4b38-90e0-fa86c65fe88d', 'Star Maps', false, 'Carlos wants to be an actor. But his father, Pepe, wants him to work in the family business, that is, male prostitution. Carlos decides that he will be one of his father''s boys until he can get his foot in the door in Hollywood. Finally one of his clients, a rich soap star, offers him a bit part in her show. Pepe tell Carlos that she is just using him and demands that he not see the women any longer. Carlos defies his father and when his big day comes he is finds out the harsh realities of life are even harsher than he imagined.', 5.9, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('883a93ec-bfef-4026-9caa-f031f59dd748', 'The Star Packer', false, 'John Travers and his Indian companion Yak are after the mysterious Shadow and his gang. When Sheriff Davis is killed, Travers becomes Sheriff. Catching two gang members, he learns of the room where the gang gets their orders from behind a fake wall safe and makes plans to trap the Shadow.', 5.3, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('70f9fd00-0c9f-470f-875d-b834fd3f4396', 'A Star for Christmas', false, 'The only thing that is working in Cassie''s world is her small town business. Her Christmas Cupcakery is a huge success, but her love life is a mess. Cassie''s whole universe is turned upside down when she falls in love with a co-worker who is revealed to be the famous and notoriously troubled actor Alex Gray. There''s no denying that Alex and Cassie are in love, but can their relationship survive the pressure of Hollywood and the holidays?', 5.3, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('6af55962-4b89-4aed-b8e6-3490075f01a4', 'Lone Star', false, 'Rip-roaring big star, big budget semi-historical story about cattle baron Devereaux Burke, who is enlisted by an aging Andrew Jackson to dissuade Sam Houston from establishing Texas as a republic. Burke must fight state senator Thomas Craden, in the process winning the heart of Craden''s newspaper-editor girlfriend Martha Ronda.', 6.2, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('f5dab33e-aef8-4c5a-83ea-a3320fc5573c', 'A Christmas Star', false, 'Born under the Christmas Star, Noelle believes she has the gift to perform miracles, so when conniving developer McKerrod threatens her peaceful life she and her friends determine to use this gift to thwart his plans and save their village.', 5.2, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('70a34132-72e5-4602-a06a-628c72660940', 'The Missing Star', false, 'Labourer Vincenzo travels from Italy to China in search of a machine with a deficiency that was produced in the now defunct establishment at which Vincenzo worked for years.', 6.8, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('28e24ff9-5f66-4788-8eff-59a5f7daa7d3', 'Star Crystal', false, 'Set in 2032, as missions from Earth are being sent to explore Mars. After two groups of astronauts are mysteriously killed following the discovery of strange artefacts on the martian surface, the crew of the SC-37 go in to try and find out what happened. They soon learn what became of their predecessors when a bloodthirsty space monster begins lunching on members of the crew. Will any of them make it back to Earth alive?', 3.5, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('6b01d87a-ba69-43ef-8e36-2b67843aad44', 'Star Wars: Republic Commando', false, 'Utilizing the heralded Unreal engine, Star Wars: Republic Commando is a first-person shooter from the perspective of an elite member of a Republic Special Ops unit. Set at the start of the Clone Wars, players find themselves able to carry out missions, as a Clone Trooper squad leader, deep behind enemy lines.', 8.5, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('40b079fa-3df4-44d8-97d6-8ec3e5ae8352', 'Son of the Morning Star', false, 'The life of George Armstrong Custer comes alive in this made for television movie.', 7.5, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('3c6036a4-0d40-4d06-90c7-f0d4af3593dd', 'Lone Star', false, 'A FOX series that was cancelled after the second episode that involves a con man who lives a double life. He''s married to two different women in two different Texas towns.', 6.9, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('30c20516-6c7f-42c4-8881-7ca8ec947b55', 'Here, Beneath the North Star', false, 'T√§√§ll√§ Pohjant√§hden alla is based on the book with the same title. It is a story of the little village. The movie starts in the 1890''s and it ends to the Finnish civil war in 1918. Story concentrates around a tenant farmer family, although it gives us a good look at the society at whole. While the class struggle depends, people of the village are driven to bloody civil war.', 7.6, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('6198dc7f-0dd0-4e6d-ab8b-2efa0b2c44d7', 'Star Slammer', false, 'Two women who have been unjustly confined to a prison planet plot their escape, all the while having to put up with lesbian guards, crazed wardens and mutant rodents.', 3.5, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('4ae79037-3773-4600-8745-65306972239e', 'The Buggles: Video Killed the Radio Star', false, 'The video for the Buggles'' classic one-shot, about how the rise of television (and, by extension, music videos) hurt the careers of those performers whose looks would not translate well to the new medium.', 6.8, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('fe50e8bf-3677-420c-90b2-ae5784896829', 'Demolishing and Building Up the Star Theatre', false, 'This film shows the demolition of the historic Star Theatre building (formerly Wallack''s) at the corner of Broadway and 13th Street, New York. To secure this unique picture a Biograph camera was kept constantly at work by specially devised electric apparatus for weeks, during which time exposures were made every four minutes, 8 hours a day. Before the contractors began their work of tearing down and after the last vestige of the building had been removed, 15 seconds of exposure at normal speed were made. Thus in the finished positive one views at first the old Star Theatre standing as it had for years looking down with serenity upon the bustle of Broadway traffic. Then as if struck by a tornado of supernatural strength, the building begins to crumble. Chimneys totters, walls cave in, and whole stories vanish, until at last the site shows only a cellar excavation; and the Broadway cars with the sidewalk procession continue as if nothing unusual had happened. When this view is shown in the reverse, the effect is very extraordinary.', 6.7, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('cb05b67c-a260-42f7-8803-b17e8349422f', 'Star Wars: Jedi Knight - Dark Forces II', false, 'You play as Kyle Katarn, a mercenary whose skills progress into becoming a Jedi knight, to stop a team of dark Jedis from taking the valley of the Jedi''s power.', 8.7, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('61fc5eea-3b75-4926-9ee9-46ca5540f1ea', 'Star Wars: Shadows of the Empire', false, 'You are the protector of Luke Skywalker.', 8.2, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('86840712-87ec-49a0-bf9e-6a8f1a036646', 'Hour of the Star', false, 'Macabea has just moved to the big city after her aunt, who raised her, died. She gets a job as a typist and moves into a boarding house with three other women. In her spare time she listens to time Radio Station; on Sundays she likes to ride the subways. She describes herself saying, "I am a typist and a virgin, and I like Coca-Cola." Then she meets Olimpico, a north-easterner like herself, who has dreams of becoming a Congressman.', 7.4, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('27987e9a-214f-4787-8252-b690ceb0cdf5', 'Star Fox 64', false, 'You take on the role of Fox McCloud, the leader of the Star Fox team. ''Star Fox'' is an elite group of fighter pilots that works as mercenaries for the Cornarian Army. Corneria is the home planet of the team, and also of Dr. Andross, a mad scientist who was responsible for the death of Fox''s father five years after General Pepper, the leader of Corneria, exiled him (Andross) to the planet Venom, and the Star Fox team went to investigate the strange activity from the planet. Many years later, Andross arises as the emperor of Venom and the supreme ruler of an almost unstoppable military force and declares war on the entire Lylat System, starting with Corneria. General Pepper calls the team to action. The orders: protect the key planets of the Lylat System, infiltrate Venom, and stop Dr. Andross.', 8.6, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('6132aeb5-11e1-4160-b3ac-daac765cd0f7', 'Star in the Night', false, 'It''s Christmas Eve. Three cowboys have just bought out a store of items as Christmas presents, despite not having anyone to give the presents to. While two of them admit to wanting to impress the pretty sales clerk, the third just felt good buying gifts to give to someone. Riding through the dark desert on horseback, they see a flashing star off in the distance, which they ride over to investigate. The newly purchased second hand star is a sign just erected by Nick Catapoli for his business, the Star Auto Court. Nick has no Christmas spirit, especially as he deals with the problems of customers, this despite his wife Rosa serving all their customers with a smile and warm heart. He believes most people are hypocrites in that they espouse this spirit at this one time of the year while not having it any other time. As such, he does not want to extend his lobby as shelter for a drifter who just wants to come in from the cold for a little while. Although the drifter tries to explain the true meaning of Christmas to Nick, Nick watching the interactions of all those around him may be a better way to show him, especially when a young and obviously in distress young couple named Jos√© and Maria Santos arrive, with no more rooms available at the inn.', 7.8, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('a5467760-b417-4081-845e-ad81c28c37d9', 'Star Wars: Empire at War', false, 'The game is set before the Battle of Yavin, while the Empire is still constructing the Death Star. The campaign goes through the events before this, on both the Rebel and Imperial side.', 7.8, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('d237250e-2d4f-446a-93fd-b3a906326075', 'Lego Star Wars: The Force Awakens', false, '30 years after the destructive Battle of Endor, a new threat emerges from the bricks of the old Empire, the First Order. Their plan: to end the New Republic and the Resistance, complete their ultimate weapon, and take over the galaxy. Luckily, hope is not lost. A scavenger, a rogue stormtrooper, and the Resistance''s best pilot must come together with the aid of old allies to end the First Order''s plans brick by brick. The most beloved LEGO video game franchise by Traveler''s Tales returns to take you back to a long time ago in a galaxy far, far away with LEGO Star Wars: The Force Awakens - The Videogame!', 8.4, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('115ddfb6-1d9e-4706-a231-bc91a5bfb818', 'The Whispering Star', false, 'A feminine android delivers packages to the scattered humans in the galaxy. With years to spare the android and us have time to contemplate what it is to be human.', 6.3, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('9202816f-425f-4d54-84e3-58f3a742bb03', 'The Star Boarder', false, 'Charlie stays at a boarding-house, where he is the landlady''s favorite. Her husband grows jealous when observing this. Their little son has a camera. He happens to take some photos of his mother and Charlie in situations which are innocent but look indecent. He also takes a photo of his father and a female boarding-guest in a similar situation. In the evening the boy arranges a slide show in the boarding-house. Suddenly also the equivocal photos of his parents appear on the screen. His jealous father gets furious and starts chasing Charlie. Soon all the boarding-guests are involved in the fight.', 5.4, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('b28b6240-4965-4d8f-8557-7f3f09685df7', '5 Star Day', false, 'Four People. One Horoscope. Infinite Possibilities. Jake Gibson''s (Cam Gigandet) horoscope forecasts a perfect FIVE STAR DAY the morning of his birthday, but what''s foretold as a flawless day unfolds to be far less than stellar. Jake''s world turns upside down when all that could go wrong ... does. Determined that Astrology has no legitimacy, Jake embarks on a journey to test the theory of Astrology by finding the three people born the same time and place as himself - Sarah Reynolds (Jena Malone), Yvette Montgomery (Brooklyn Sudano) and Wesley Henderson (Max Hartman). The journey quickly uproots Jake from the small college town of Berkeley, California, to downtown Chicago where he sets out to find and interview Sarah, Yvette and Wesley to see if their birthdays proved to be as deplorable as his own. Jake''s pursuit in finding his three Astrological matches (or Zodiac twins) will not only test his convictions, but validate how life''s unexpected twists of fate can deliver much more than the anticipated. The unforeseen takes Jake from the Windy City, to the boardwalk of New Jersey''s Atlantic City, to the bustling streets of New York. What Jake learns along the way is an important lesson about life, love, fate and destiny that will unexpectedly change his life forever.', 5.8, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('a2bc325e-7aee-47e1-a79f-e9b17e371111', 'Lego Star Wars: The Freemaker Adventures', false, 'The series stars the Freemakers, a family of scavengers who build and sell starships from the scoured debris of space battles strewn throughout the galaxy. When their youngest discovers a natural connection with the Force through an ancient artifact . The Kyber Saber, his world is turned upside down, and he and his family are thrown into an epic struggle against the Empire to restore peace and freedom to the galaxy. Throughout their adventures, the Freemakers explore new worlds, meet new and familiar characters, and learn the true value of what it means to be a family.', 7.5, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('54f8e6a1-2010-44d2-8bee-c59c92f25528', 'Star Blazers 2199', false, 'In the year 2199, Earth is invaded by an extraterrestrial race known as the Gamilas, who hail from a dying planet and decide to make Earth their new home. The Gamilas proceed to rain radioactive bombs on Earth, rendering the planet''s surface arid and uninhabitable (but hospitable for their race). Earth''s space fleet is hopelessly outclassed by the Gamilas and all seems lost... until a mysterious space probe is retrieved on Mars. The probe contains blueprints, and a message from Queen Starsha of the planet Iscandar, who claims to have a device which can cleanse Earth of its radiation damage. The blueprints are of a supercraft that can enable any ship to head to Iscandar (situated in another galaxy) and back in a year, and with these plans the denizens of Earth secretly rebuild a Japanese battleship, the Yamato, into a great space battleship. A large intrepid crew of 999 departs for Iscandar in the Yamato to require the device... but with the menace of the Gamilas, can they succeed in time?', 8.2, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('c1f072ba-3a8b-4415-a401-5c68f9f1d614', 'A Star Is Bored', false, 'Daffy Duck must double for Bugs in any slapstick which Warners considers too dangerous for its star Bug Bunny.', 7.7, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('10958306-c05e-4bb2-b0db-165a7a73e08d', 'Star', false, 'Three different persons, three different lives are connected in a mysterious way. 15-year old teenager suffering of misunderstanding, his glamorous and arrogant stepmother and the young untalented but full of optimism actress. Their destinies aren''t predetermined and their lives are very fragile.', 7.1, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('408d6401-6f69-409c-9ac0-851b252a58e2', 'The Princess with the Golden Star', false, 'A Czech fairy tale about a princess named Lada who runs away from home in a mouse fur disguise in order to escape an unwanted and forced marriage.', 7.3, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('3e4eb2d3-eff2-49ed-8b11-f6f9028c2a19', 'Star', false, 'After Vietnam, Crystal Wyatt meets a returning soldier, Spencer Hill and although she is young they are drawn together and find they have a lot in common. Spencer''s visit is fleeting and although he leaves, Crystal still thinks of him often. Crystal''s father dies and her mother, who has never really loved Crystal, begins to mistreat her and use her as a skivvy. After years of this, Crystal is attacked and raped by her brother-in-law. When Crystal gets her father''s shotgun to kill her brother-in law, her brother-in-law accidentally shoots her brother, and Crystal runs away from the farm to San Francisco where she becomes quite well known as a singer. Menawhile, Spencer has embarked upon a socially beneficial, yet ill-advised marriage, when he meets Crystal again in San Francisco. They embark on a hurtful affair, but the path does not run smooth for them. As intertwined as their lives are, it takes Spencer time to act like a decent man and do what is right.', 5.8, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('e9d2d818-7c6f-4a7a-b5eb-524966afbe55', 'Hugo: The Movie Star', false, 'Hugo, the one-of-a-kind jungle animal, is snatched away from his home for a second time in another attempt for him to become an animal actor. Meanwhile, he''s reunited with Rita the kind, streetwise fox. Finding that life in front of and behind the camera isn''t so bad, he grows more unaccustomed to wild life once he escapes and slowly weakens his relationship with Rita.', 5.2, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('0a6cc495-8b1c-4e39-918d-73d125f8f717', 'Star Leaf', false, 'Some Highs Are Out of this World. Star Leaf is a sci-fi thriller about an extra-terrestrial form of marijuana discovered in the Olympic forests. The main character is a veteran of the Afghanistan war, and the film has PTSD and its treatment with cannabis as an underlying theme. Shot entirely on Washington''s Olympic Peninsula, the movie stars Julian Gavilanes and Russell Hodgkinson of Sy-Fy''s Z-Nation.', 3.6, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('6f91d948-52f6-4cc3-95e4-74b8789874f9', 'Star Wars: Rogue Squadron', false, 'Luke Skywalker leads the Rebel Alliance''s elite starfighter unit, Rogue Squadron, into battle against the Empire.', 8.1, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
