INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('6d53b945-0391-47c5-9a21-300c7c26bc07', 'Star Wars: The Legacy Revealed', false, 'Filmmakers, critics and even politicians discuss the social impact of the "Star Wars" films and the franchise''s reliance in mythology and history.', 7.8, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('750cc470-08a2-4b4b-959c-00f2baef0aab', 'The Prince and the Evening Star', false, 'The old King (Vladim√≠r Mens√≠k) is not satisfied with his four children. It is high time for the Princesses to get married and for the Prince to assume the reign. Once the King sets out to the fowling and he entrusts the kingdom to the Prince Velen (Juraj Durdiak). His sisters want him to provide them with the bridegrooms. A beautiful girl Evening Star (Libuse Safr√°nkov√°) appears to Velen and he falls in love with her at once. Evening Star also likes Velen and therefore, for a kiss, she helps him to get married his sisters to her brothers Moonbeam, Sunbeam and Wind. After the King returns home he does not find the daughters because the bridegrooms took them right away. The angry King assigns the Prince to bring them home.', 7.1, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('03de7fab-6f8e-45dc-872d-f14cae7d8c3c', 'Prelude: Dog Star Man', false, 'A creation myth realized in light, patterns, images superimposed, rapid cutting, and silence. A black screen, then streaks of light, then an explosion of color and squiggles and happenstance. Next, images of small circles emerge then of the Sun. Images of our Earth appear, woods, a part of a body, a nude woman perhaps giving birth. Imagery evokes movement across time.', 6.9, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('9e8712e8-5b5b-46e4-956a-3c69388b8dbc', 'Cloud Capped Star', true, 'To Ritwik Ghatak film was not merely a form of entertainment, but a weapon, a medium to portray struggle of common men. He was successful neither in his career nor he could he become a good...', 8.1, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('d4563f83-33ef-4e2d-af14-5dff6f71751a', 'Star Knight', false, 'When a dazzling craft illuminates the sky above a medieval European village, the townspeople fear mayhem while the ruling party prepares for battle with the mysterious "dragon in the sky." After Princess Alba is discovered missing, the quest for power and the young girl''s affections drive Klever to free her from the strange cosmic knight. But is that her desire? Worldly boundaries are crossed in this gothic sci-fi tale of power, greed and the universal language of love.', 4.1, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('2205c3d8-a8d5-41b6-9ce3-475bef2cee6e', 'Confessions of an Action Star', false, 'A ''mocumentary'' on the rise and fall of Chip and Dales dancer turned martial arts action star, Francis Allen Sledgewick, AKA Frank Sledge. When fame and fortune caused Frank to lose his sense of what''s truely important, he realised he''s going to have to get in touch with his roots if there''s ever going to be a comeback.', 2.9, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
