INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('c2e59cdb-99f6-4ed2-a645-f074b8e76d80', 'From ''Star Wars'' to ''Jedi'': The Making of a Saga', false, 'Ever wonder how they ever made Star Wars, Empire Strikes Back, and Return of the Jedi? Well this documentary explains it all as we''re taken on a behind-the-scenes tour of the making of the Star Wars saga. It shows how the puppets are made and worked, and creator George Lucas talks about what influenced him to do it, and everything. Narrated by Luke Skywalker himself, Mark Hamill.', 7.7, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
