INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('352ddab9-29a4-440c-9bf8-0b82b3c35865', 'Star Wars: The Force Unleashed - Ultimate Sith Edition', false, 'Casts players as Darth Vader''s "Secret Apprentice," unveiling new revelations about the Star Wars galaxy seen through the eyes of a mysterious new character armed with unprecedented powers.', 8.1, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
