INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('fa1996f9-0cda-4280-b1d7-fb632d15c689', 'Star Wars: Wrath of the Mandalorian', false, 'Years after the Clone Wars end, Darth Vader sends bounty hunter Boba Fett to Kashyyyk to track down the last of the Jedi. Fett, motivated by revenge for his father''s death, proves effective - but he soon finds out a terrible truth about Vader while on the hunt that gives him a change of heart.', 3.3, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
