INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('22b446b7-69e5-4c66-b143-b857acf2e8de', 'Laura''s Star', false, 'Laura is seven year old country girl, who''s just moved along with her family to a city. On her first night in their top floor apartment, she sees a shooting star, actually falling to earth, she finds it in a park and discovers it''s a living being. Taking it back home, she and her toddler brother Tommy discover it can do miracles like making people fly and bringing inanimate objects to life. But over time both notice that the longer it stays on earth, the weaker it becomes, can they along with next door neighbor Max find a way to send it back into outer space, before tragedy occurs?', 6.1, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('07711d65-1a60-46de-a0eb-eed2bd604e07', 'Dog Star Man', false, 'An experimental film from Stan Brakhage in which a man and his dog ascend a wooded mountain.', 6.4, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('b409472b-4e78-47f8-9d12-c3ba44377ca8', 'The Making of ''Star Wars''', false, 'Ever wonder how they ever managed to make a movie like Star Wars? Well, bickering droid duo C-3PO and R2-D2 host this tour of the mind of creator George Lucas and what inspired him to make the movie. Even interviewed are the cast and crew, even features scenes of when C-3PO, R2-D2, and Darth Vader planted their footprints (or in R2''s case, tread-prints) into cement. Also discussed is Star Wars mania, how fans loved the movie, collected the merchandise and danced the disco music. Also shown are behind-the-scenes looks at the movie, as well as how difficult each effect was in doing since they didn''t have the convenience of computer animation back then.', 7.5, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('59ba5b49-d840-4ffe-bf5f-4ad6932b9f59', 'Invasion of the Star Creatures', false, 'A pair of comical soldiers (Robert Ball and Frankie Ray) investigate a mysterious crater in an atomic detonation area and discover several beautiful alien vixens (Dolores Reed and Gloria Victor) who plan to conquer the world using an army of vegetable monsters.', 3, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('412612fb-da46-424f-9c20-1894f64ec0dc', 'Glow Up: Britain''s Next Make-Up Star', false, 'A talented group of aspiring make-up artists attempt to prove their potential to industry professionals in this competition hosted by Stacey Dooley.', 6.4, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('ed79fca5-b00a-4c15-944c-afff068981a0', 'Star Wars: Episode I - Racer', true, 'Compete in the galactic pod-racing championship as one of the many pod-racers featured in ''Star Wars Episode I: The Phantom Menace''.', 7.7, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('bda27018-0a16-495d-8c9a-68f63d3eb22b', 'Kaleido Star', false, 'Sora, a young girl from Japan, comes to America in search of her dream. She wants, with all her heart, to be a member of the famous Kaleido Stage, a combination of musicals, acrobatics and magical effects. With the help of her friends, she struggles to make this dream come true.', 7.8, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('913ae5fb-32fa-4aa4-a288-3eb24390888a', 'Ich bin ein Star - Holt mich hier raus!', true, 'I''m a Celebrity - Get Me Out of Here. (often referred to as a jungle camp) is a reality show that has been aired by the RTL since 2004.', 4.8, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('9619cf18-3656-49fa-b96f-b6d913d6b5a2', 'Star Trek: Horizon', false, 'In a time prior to the United Federation of Planets, a young coalition of worlds led by Earth battle the Romulan Star Empire for their very survival.', 5.7, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('90dc9f68-8b9c-4b5b-83d4-94c21b118318', 'Plastic Galaxy: The Story of Star Wars Toys', false, 'When Star Wars landed in the theaters, it introduced audiences to a galaxy filled with heroes and villains, robots and space ships, and a dizzying variety of alien life. But when the lights came up, they all disappeared... Unless you had all the toys. In which case, the adventure never had to end. In backyards, playgrounds, basements, and bedrooms, Star Wars toys helped kids re-enact scenes from their favorite movies, and create entirely new dangers for Luke Skywalker and his friends to face. They were lusted after on holidays and birthdays, swapped with great cunning out on the school yard, and carefully collected like fine treasures. Like no toys before them, the action figures, space ships, play sets, and props were a phenomenon that swept the nation with as much force as the film that inspired them. Along the way they transformed both the toy and movie industries, earned those behind them vast amounts of wealth, and ultimately created a hobby that, 30 years later, still holds sway over not only the people who grew up with the toys, but also an entirely new generation of fans. Plastic Galaxy is a documentary that explores the groundbreaking and breathtaking world of Star Wars toys. Through interviews with former Kenner employees, experts, authors, and collectors, it looks at the toys'' history, their influence, and the fond and fervent feelings they elicit today.', 6.4, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('0e90c94b-257b-43b5-b27c-6707ae2256f1', 'Star Wars: Dark Forces', false, '', 8.1, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('3fe066cd-71a3-4300-9dad-92ee3bb213f3', 'Five Star', true, 'A member of the notorious Bloods since he was 12 years old - both in the film and in real life - Primo takes John, the son of his slain mentor, under his wing, versing him in the code of the streets. Set in East New York, FIVE STAR blends documentary and fictional storytelling as director Keith Miller carefully avoids worn clich√©s of gang culture to offer a compelling portrait of two men forced to confront the question of what it really means to be a man.', 5.4, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('50ba7033-b924-490b-8699-16a108f4a4c2', 'Barbie: Star Light Adventure', false, 'Barbie(TM) is a cosmic princess who flies high on her hoverboard through a far-off universe with her adorable and devoted pet sidekick, Pupcorn. One day, everything changes when the twinkling stars start to dim and slow their dance in the sky. Barbie(TM) travels to a beautiful new planet to join a special rescue team on a mission to save the stars. Once there, she teams up with a group of talented new friends who work together to save the galaxy through exciting hoverboarding adventures. Barbie(TM) soon discovers that if she listens to her heart, and with the help of her friends, she might be the leader the whole universe has been waiting for!', 5.9, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('628ca7c1-ffc4-429c-9295-c7e4870d70b9', 'Chatur Singh Two Star', false, 'After an incident at Dadar Railway Station, Mumbai''s Police Commissioner Rajpal K. Sinha suspends bumbling police detective, Chatur Singh, but is compelled to reinstate him after no-one within his department wants to be assigned with the security of disgraced and arrested Agriculture Minister Y.Y. Singh, who, after feigning an illness, is hospitalized. Chatur and his deputy, Pappu Panther, accordingly attend to the hospital and screen everyone that goes to visit him, including his wife, Savitri, and Secretary, Sonia Verma. Shortly thereafter, Singh is assassinated, Sonia is arrested as a suspect and lodged in a cell and refuses to divulge any information. Chatur decides to let her escape so that he can follow her and find out who was behind this high-profile killing. Sonia does manage to escape but he is not quick enough to follow, and she ends up in Capetown. Chatur and Pappu must now travel there and not only locate and apprehend Sonia but also must try to investigate her involvement in her employer''s assassination.', 1.8, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('e6dcfad1-bd37-49f1-88a7-e466d254c587', 'Star Quest: The Odyssey', true, 'As our world expands to include the entire galaxy everyone rushes to claim their own piece of this new world and thousands of colonies arise. With no core government, rogue colonies begin to wreak havoc and without a centralized army to protect the innocent peace is all but lost. Now at the end of mankind''s greatest battle, empires will crumble, alliances will form, enemies will rise, and heroes will fall.', 1.5, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('6c6bc436-2cd6-4c73-b3ab-33a073c4a673', 'Justin Bieber: A Star Was Born', false, '', 1, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('f3deb39a-5f43-4b41-8bb7-9bc82b1d90d7', 'Star Raiders: The Adventures of Saber Raine', false, 'Rocket ships, Rayguns, and Robots abound in this heart-pounding tale where the stellar adventurer Saber Raine is hired to guide three elite soldiers on a rescue mission to recover a prince and princess who have been abducted from their home world. The trail leads Saber and his allies to a planet deep within uncharted space that is inhabited by strange mutated creatures, leech-like desert marauders, renegade mercenaries, alien outcasts, and cybernetically enhanced soldiers that guard mysterious ruins of an empire long forgotten. Deep within the ruins, Sinjin, a sinister overlord freed from a cryogenic chamber that was his prison for many centuries, is now in league with the Quintari, a malevolent insectoid race known throughout the galaxy as the scourge. In possession of a powerful new energy source, Sinjin plots his revenge on the descendants of those who betrayed him in the past. Can our heroes complete their rescue mission and stop Sinijin from unleashing his fury on the universe? Find out in Star Raiders: The Adventures of Saber Raine!', 3, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('d13632e3-e2c4-4f77-8540-178524f0ff74', 'Star Wars: Threads of Destiny', false, '94 years after The Battle of Yavin, the New Republic has been resurrected and democracy once again rules the galaxy. The Jedi Order is reestablished on the planet Yavin 4, and has continued to train new Jedi Knights in the art of peace and justice. But all is not peaceful in this new world. With the fall of the Dark Empire, the ancient Skenvi Empire now comes out of the shadow to make its move. The Skenvi now oppose the New Republic for control over the galaxy with their aggressively growing empire. The Skenvi seek to seize control of all the galaxy''s most valuable resources to cripple their enemies. And if a planet refuses to join them, they have been known to take very aggressive actions. Caught in between this struggle over the fate of the galaxy is the little planet of Coreign. The planet possesses a very powerful resource that would greatly favor the side that has access to it if a galactic war was to emerge. In its eagerness to gain access to Coreign''s resources, the Skenvi Empire sends its most infamous negotiator, Lord Siege. He is a man who is known throughout the galaxy for seeing that the Skenvi Empire gets what it wants by all means necessary. The New Republic sends two of its Jedi ambassadors, Master Soran Darr and his padawan, Raven Darkham.', 4, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('0a8448b9-5dcb-4bb3-ba9a-c7a4f74d4aa9', 'Under the North Star', false, 'A new film-adaptation of V√§in√∂ Linna''s famous book here Beneath the North Star.', 6.8, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('b094c008-6bae-4b7c-9006-186832b69747', 'Confessions of an Action Star', false, 'A ''mocumentary'' on the rise and fall of Chip and Dales dancer turned martial arts action star, Francis Allen Sledgewick, AKA Frank Sledge. When fame and fortune caused Frank to lose his sense of what''s truely important, he realised he''s going to have to get in touch with his roots if there''s ever going to be a comeback.', 2.4, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('d9aa0751-78ba-4988-aae0-6d9c886f9b4e', 'Twin Star Exorcists', false, 'Grotesque monsters known as Impurities reside in Magano, a realm parallel to the present day. Exorcists purify these evil apparitions to protect the people. Rokuro Enmado is opposed to becoming an exorcist, even though he has the talent to be one, but an oracle gives him the title of "Twin Star Exorcist," the name bestowed upon married exorcists. Benio Adashino, the girl who receives the title along with Rokuro, is determined to exorcise all the Kegare, or Impurities, in the world. The two find themselves wrapped up in more and more battles together as the Twin Star Exorcists.', 7.1, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('993c298b-b051-4cbd-b52b-c8378506e985', 'Follow a Star', false, 'Norman Truscott is a store worker who dreams of stardom. Vernon Carew is a singer who''s star is fading. Vernon manages to get a recording of Norman singing and passes it off as himself.', 6.7, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('52a93638-ee55-4bde-8a5d-f0b6cd4103ef', 'New Fist of the North Star', false, 'Kenshiro is back to make more people''s heads explode in this 3 episode anime OVA.', 7, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('5b20c8b1-8fd1-44df-ae61-3c38ecaacbb6', 'The Star Witness', false, 'The Leeds family is thrown right in the middle of a war between the cops and gangland when they are the only witnesses to two murders committed by gang kingpin Maxey Campos. Initially positive in their identification of the murderer, their attitudes change when young Donny Leeds is kidnapped by Campos'' boys. No amount of threatening with perjury by D.A. Whitlock can get them to tell the truth - except for cantankerous old Grandpa, civil war veteran, who berates his family for failing to do their civic duty, whatever the cost. Though having his doubts as to the credibility of his star witness, Whitlock is nevertheless taken aback when he learns Grandpa has disappeared just before he is to testify.', 6.4, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('b6a1c76d-1a73-46dc-ae94-dfede9e957ef', 'Star Force: Fugitive Alien II', false, 'In this second film compiled from two episodes of a Japanese TV serial, Captain Joe, reformed interstellar marauder Ken and the rest of the crew of the Backus-3 set off to destroy an alien race''s super-weapon, face off with Ken''s vengeful ex-lover Rita and confront the sinister leader of the marauding Star Wolves.', 1.9, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('c446dd04-376f-4de2-b9bd-40c3edf1eafc', 'Star in the Dust', false, 'The sheriff of Gunlock is planning to hang Sam Hall, who shot three farmers found on cattle land, at sundown. At the casino, betting is 8 to 3 he won''t make it. The cattlemen are set to rescue Sam; the farmers hope to lynch him before he can be rescued; and Hall schemes for escape with his girl Nellie. But Sheriff Jorden is most concerned with finding out who hired Hall: a leading suspect is the sheriff''s future brother-in-law.', 6.1, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('aa098c47-33f0-4b16-adda-bbd54081e2b3', 'Star Odyssey', false, 'Earth is attacked by an intergalactic villain and his army of robotic androids.', 2.5, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('1f3dee9d-1352-413a-84e2-381fe945d1fa', 'Quentin Tarantino''s Star Wars', false, 'We''re all familiar with the story: a long time ago in a galaxy far, far away, on a planet called Tattooine, a boy named Luke Skywalker is adopted by the only remaining Jedi knight and helps the Rebellion destroy the Death Star after learning the ways of the force. However, what if "Pulp Fiction" director Quentin Tarantino had directed George Lucas'' script, using Kenner action figures and stop computer animation?', 4.8, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('779a13ed-9843-47e8-bf95-a090f46894a7', 'The Southern Star', false, 'Comedy adventure based on a Jules Verne novel about the ups and downs of jewel thieves in the wilds of Africa circa 1900. George Segal is the appealing hero-heel and Ursula Andress is visually stunning as the lady in the proceedings. Orson Welles has a small role.', 5.4, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('93508b11-9a9e-45a8-b4dc-72019c3cec09', 'Star Stories', false, 'Comedy Thats Shows Us How Some Of The Worlds Biggest Stars Came To Fame', 7.4, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('543a24a7-b5e2-43cf-afbd-7581faeec2ec', 'Star Wars', false, 'In this game, you assume the role of Luke Skywalker and fight past many enemies to to reach and destroy the Death Star.', 7.8, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('3ae0149a-b86c-4eef-9832-d7886961cf12', 'A Beautiful Star', false, 'It portrays a family on Earth who come to believe that they are actually from other planets all of a sudden. They try so hard to save the endangered planet Earth but things get crazy on the way.', 5.7, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('a5a28a9b-e674-49d5-8cf1-16238e240c1b', 'She Likes Red Star', false, 'Srba is graduating pupil and football fanatic, or more precise king of a street soccer, who plays even without others, in a winter, summer, rain or snow, while his grandma lights narrow backyard (so called small Maracana) with a flashlight. He wouldn''t accept to become professional by no means and to play for money, rejecting offers of various scouts promising him a career in Spain, Greece, Germany, Turkey... main characters of Srba''s school days are his best friends, Daca who is secretly in love with him ever since first grade, professors Hannibal and Darwin and Beki, new schoolmate to whom Srba fells in love - and she loves Red Star...', 3.8, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('be10e4ee-a2ee-4d2d-8da0-af749a779c5f', 'Frat Star', false, '"Frat Star" explores the alluring, superficial, manipulative, and dark world of Ivy League fraternity culture. An insecure, poor, and broken-hearted Nick enters freshman year with no interest in fraternities. This all changes when his old money roommate Billy convinces him to pledge.', 3.5, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('cec08caf-decc-429f-9f3c-9e4ca37d867c', 'Star Crossed', true, 'A modern day "Romeo and Juliet" is told against the backdrop of professional football in Portugal, with two feuding teams, Castelo and Invicta, filling in as the Montagues and the Capulets. The latest incident in the feud is an on-field brawl between the players worse than they have ever had, which results in an indefinite suspension of both teams from the league pending a full investigation. Each game not played results in a loss and thus less and less chance of either team reaching the post-schedule championship. Beyond the direct measures to have the league lift Invicta''s suspension, its owner/president, Jos√© Carlos Silva, believes another indirect measure is to win in the court of public opinion by currying favor with Philip Andrews, a British documentarian filming a movie about the feud, and whose cameras and stories he hopes will document that Invicta is the innocent victim. To curry that favor, Jos√©, upon Philip''s expression of interest, is pushing his innocent daughter, In√™s Silva, to date Philip, in who she truly has no interest despite Philip being a decent man. Meanwhile, one Castelo player not involved in that on-field incident is Brit Paul Collins, who was out sick that game and who is nursing a broken heart over a recent break-up with his girlfriend, Danielle. However, Paul and In√™s fall in love at first sight when they spot each other across a crowded room at a party. Despite the obstacles, Paul and In√™s do clandestinely see each other, with Carla, In√™s'' paternal grandmother, and Dr. Lawrence, Paul''s American physician, reluctantly being their co-conspirators, reluctant in that they are more cognizant about a Paul/In√™s relationship being fraught with life long problems. As Paul and In√™s'' love deepens, so does the feud, the two which truly may be incompatible.', 5.9, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('9905262a-1c88-445f-b80c-59679ed95325', 'Kirby Super Star', false, '', 9.2, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('305f9506-3b3d-46cd-8dae-303cbe21015f', 'Star Tours: The Adventures Continue', false, 'In the newly opened Star Tours touring agency, C-3PO is accidentally made to be the pilot of a StarSpeeder 1000. Also on board the craft is one of the guests, who is revealed to be a rebel spy who must be safely delivered from the Empire. With multiple beginnings, middles, and ends, there are 54 possible routes the StarSpeeder 1000 can take.', 8.3, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('95281f37-5b19-4eef-b50b-f2237630447e', 'Broken Star', false, 'Abandoned by her friends and family and with her career in jeopardy, starlet Markey Marlowe is sequestered in a duplex with a reclusive landlord who just may be more dangerous than she is.', 4.2, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('51e01382-0ddd-4e4d-bd1d-0a8cfb4fdb78', 'Star Trek: The Experience - The Klingon Encounter', false, 'An attempt by some evil Klingons to kidnap visitors at The Las Vegas Hilton is foiled when the 24th century starship U.S.S. Enterprise transports them safely aboard. Taken to the bridge, the guests are told by Commander Riker that the Klingons plan is to disrupt the future time-line. Riker orders Lt. Commander LaForge to take them through the Klingon battle-zone and back to the 20th century aboard a shuttle-craft so that the time-line can be restored.', 7.7, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('f3687911-e2e9-409d-8b41-5d17baad783a', 'Star Spangled Rhythm', false, 'Pop, a security guard at Paramount has told his son that he''s the head of the studio. When his son arrives in Hollywood on shore leave with his buddies, Pop enlists the aid of the studio''s dizzy switchboard operator in pulling off the charade. Things get more complicated when Pop agrees to put together a show for the Navy starring Paramount''s top contract players.', 6.8, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('b769337c-bbc5-4493-9150-2bdec42b7698', 'Earth Star Voyager', false, 'The Earth Star Voyager is a spaceship sent to another solar system to prepare it for colonization. Earth itself is horribly polluted, so the mission is vitally important. But as the ...', 7, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('c4e2aebb-e23b-4dc4-a75a-5616de9b8478', 'My Lucky Star', false, 'A woman gets caught up in an international diamond heist which pushes her close to a spy who is trying to save the world.', 5, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('556701ae-4a5c-481f-a32e-7913cbf72cf6', 'Make Me a Star', false, 'Menton Gill is longing to become a cowboy actor and leaves his hometown to try his luck in Hollywood, but there his acting ability is regarded as non-existent. Actress Flips gives him a chance in a bit part, but he fails in that; however, the way he fails makes her think that he could be a good comedian. She persuades the studio to put him in a western parody, not telling him what they''re really planing, because they know that he does not like comedies. Rather than ending tragic-comically, the movie becomes a brilliant coda to art and its servants, the artists, in this case the magniloquent Joan Blondell and Stuart Erwin.', 6.5, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('7b641f7c-e3ce-41e6-bd29-818d8979748b', 'Star Wars: A Musical Journey', false, 'Actor Ian McDiarmid introduces several music videos featuring the famous Star Wars scores composed by John Williams. There are sixteen chapters in all, and are all perfectly created to show us the great music from the six films.', 8.6, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('148eb76f-8a0d-480f-98bc-627cf69a86db', 'Star Trek: Generations', false, 'Captain Jean-Luc Picard and the crew of the Enterprise-D are in the middle of a crisis that has been in effect for more then 80 years. An evil El-Aurian scientist named Tolian Soran has been destroying stars in order to change the path of a space anomaly called the Nexus, a ribbon of energy that acts as a gateway to another reality where all of your hopes and dreams come true. In order to do so, Soran has teamed up with the renegade Klingon faction lead by the Duras sisters, and plans on destroying the Veridian system (inhabited with hundreds of millions of people) in order to cross over into the Nexus.', 7.1, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('95ca9762-1948-444a-a561-a4bc0c270931', 'Shine, Shine, My Star', false, 'The story of a young actor during the Civil War years who drives around the countryside giving free performances in order to bring art to the masses.', 7.5, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('37ca9e34-0bae-4f4c-a474-9b32d1537356', 'Lego Star Wars: The Quest for R2-D2', false, 'During a space battle with the sepretists R2-D2 ends up blasting out of Anakins ship and end''s up getting lost with precious data. Now the Jedi and the sith are hunting down the droid. Who will win?', 6.5, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('330b6b55-6be7-4609-9d42-2223fc62b98a', '√à nata una star?', false, 'Mother find out from her neighbours, that her teen son is a pornstar with really big tool. This comedy shows how mother and how father deal with this problem.', 4.9, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('a345fcf2-06a8-4756-8124-537184a03121', 'Star Trek Voyager: Elite Force', false, 'Lt. Commander Tuvok, chief officer of the USS Voyager, has started a force against the dangerous races of the Delta Quadrant. You play as a member of this Elite Force of Starfleet Security officers as you battle the Borg, Hirogen, Species 8472, and other races of the Delta Quadrant. Your arsenal includes weapons seen on Voyager, as well as new alien and prototypical Starfleet weapons.', 8.3, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('2d412862-d736-42be-bc4b-c19be7e9a452', 'Fist of the North Star 2', false, 'Peace was brought to the land by Kenshir√¥ years ago. But now he is gone; merely a legend. Along with the peace came a distinction in classes, and soon a new era of violence began. A new tyranny arose, the fearsome fighters of the Gento K√¥ Ken style that fight for their Emperor of Heaven. Rin and Bat have grown up and formed a resistance called the "Hokuto Army". When times are at their worst, Kenshir√¥ returns! Can he stop the Gento terror? And what is the secret of the mysterious Land of Shura?', 8.3, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('83f06473-ba24-4c83-9d48-0d8604197eb0', 'Daytime Shooting Star', false, 'Suzume Yosano''s parents have decided to move to Bangladesh when her father''s job gets transferred there. However, they''re not taking her with them. So, Suzume moves to Tokyo to live with ...', 6.9, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('70cce670-1947-48e6-b12a-5c72966590b1', 'Pup Star', false, 'Welcome to a world where dogs can not only talk -- they can SING! Tiny, a cute little Yorkie pup with a big voice, gets a chance to audition for the singing competition for dogs, "Pup Star." After she earns a place in the finale, she''s suddenly dog-napped! But with the help of her new friend, Charlie, a retired rock-and-roller, she escapes. Together they leave on an incredible journey through some of music''s most iconic cities. They meet Big Ears - a soulful Bassett Hound who teaches Tiny to belt out the blues, Murray - a spiritual shaggy dog who helps her find her inner rhythm, and Emily Rose - a country-singing shepherd who helps her learn to sing from her heart. Most important of all, they all encourage Tiny to believe in herself and never give up on her dreams! Filled with all-new songs and the biggest cast of talking and singing canines ever assembled, Pup Star is an incredible family film filled with fun, music and heart.', 4.2, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('9658c540-e09f-4bc1-8014-98e2bdb268c2', 'Child Star: The Shirley Temple Story', false, 'The life, laughters, and luck of one of the most famous and beloved child stars, Shirley Temple.', 6.2, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('89eede61-cf90-4417-923b-f403f7ffb24d', 'Star Trek', false, 'Kirk and Spock team up against the Gorn.', 6.9, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('5bf9b9b2-e53f-4d1e-9148-2ebb52096fd9', 'Catch a Falling Star', false, 'Sydney Clarke is a spoiled famous actress who is shooting a film when she suddenly gets angry and storms off. She wakes up in the middle of nowhere and gets a ride to a small New England town. There she meets and develops a friendship with Joyce, a waitress at a bowling alley. There she meets Ben, a steel mill owner, and later when she goes to get a job in that small town, she meets Ben again. Sydney becomes a nurse at the mill. All the men adore her. There they have many great times together, and Sydney realizes how important real friends are and that small towns are better than big name Hollywood.', 6, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('538c63cc-096b-4e29-8b36-d83c299199b3', 'Perry Mason: The Case of the Shooting Star', false, 'A comedian hatches a great joke: rig a fake killing live on TV. He takes a gun with blanks, and shoots his accomplice during a talk show. Happy that his joke has been successful, he walks away. His accomplice is really dead, however, and nearly a million viewers saw him pull the trigger.', 6.9, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('36e7d0f5-1b83-4403-bd5e-a27c6aede9c6', 'King Star King', false, 'King Star King is an intergalactic warrior who fights various evil foes throughout the Gigantiverse. Always buy his side are his team of "strange heroes" which includes Hank Waffles, Pooza the Wizard, and Gurbles the flying robot bear.', 5.9, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('1ddde78c-7d9f-4381-bbd6-c0a28f914208', 'Lego Star Wars: The Yoda Chronicles', false, 'Centered around Yoda''s stories that take place before ''''Lego Star Wars: The Padawan Menace''''. Yoda begins by training Padawans at the Jedi Temple Academy, but then he feels a disturbance in the Force and rushes off to fight the Dark Side.', 7.5, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('fc9d8df5-217c-4f5d-8fd2-3185ba77c22d', 'From Star Wars to Star Wars: The Story of Industrial Light & Magic', false, 'The incredible evolution of George Lucas'' special effects dream factory, including an inside look at "Star Wars: Episode One - The Phantom Menace."', 7.2, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('928b88eb-ff7f-4c7a-814e-8b1bbab89791', 'Morning Star', false, 'In time of war, a man must survive to make a journey to fulfill a promise made and discover the truth. After a terrible battle, he sees his great friend perish, leaving him one request - that he visit the king, father of the deceased, to give him the news of his death. Stuck to the promise, the warrior part to the meeting with the king, who lost his only heir.', 2.7, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('1ad90a6e-44d1-4f35-a57d-9532bbfa8fe2', 'The Ancient Magus'' Bride: Those Awaiting a Star Part 2', false, '', 7.8, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('1df6c494-637a-4d72-a468-009819b3bc86', 'Star Wars: Jedi Knight - Mysteries of the Sith', false, 'The game starts with Kyle Katarn from Jedi Knight and Dark Forces battling his way onto an asteroid that is being used by the Empire to attack a rebel outpost. Kyle then leaves and the focus shifts to his apprentice, Mara Jade, who completes several missions for the rebels before setting out to locate the missing Kyle.', 7.9, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('20630164-c71e-4ac5-adc8-15cd4d068313', 'Battle Star Wars', true, 'When the leader of the evil Coalition threatens to destroy a Rebel planet for its resources, his daughter will have no choice but to join the Rebel side and fight for what is right.', 1.6, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('d072f515-e243-4396-af2c-9a463a62c2da', 'Chasing the Star', false, 'Three Magi Priests journey the unforgiving desert in search of the new born King.', 3.1, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('bcac60b6-04c3-40db-a171-32ef3cbd90c4', 'Joan Crawford: The Ultimate Movie Star', false, 'In this documentary on the life of ''Joan Crawford'', we learn why she should be remembered as the great actress she was, and not only as the "mommie dearest." caricature she has become. Friends, fellow actors, directors, and others reminisce about their association with her, and numerous film clips show off her talent from her start in silents to bad science fiction/horror movies at the end of her career. Daughter ''Christina Crawford'' even explains the origin of the phrase "No more wire hangers!".', 6.2, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('c5f83628-4ec0-4fbb-9880-3904895cb47a', 'Star Fox', false, 'Join the Star Fox team as you battle the forces of the evil Andross.', 8.1, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('ed312b8e-af4b-46c8-977d-62a302d45e1a', 'Mr. Plinkett''s The Star Wars Awakens Review', true, 'Mr Plinkett discusses his views and personal feelings on The Force Awakens and the current state of the Star Wars franchise.', 8, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('d8b54bd4-fe17-4d99-9ebb-28e85ab7d92e', 'Lego Star Wars: The Yoda Chronicles - The Phantom Clone', false, 'Grievous lures Yoda away from the Jedi Temple and steals the Padawans light sabers. Dooku plans to use the crystals inside the light sabers to make Sith clones. It is up to Yoda and the Padawans to prevent Dooku from carrying out his plan.', 7, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('85a09f70-e893-474e-a897-69d73348741b', 'Pop Star', false, 'When talented young singer, Roxie Santos, meets music producer, Eddie Marz, he promises her an amazing new lifestyle and a future record deal. All he needs her to do is first lend her voice to a celebrity with no singing talent. However, when things go too far and it looks like she might lose her "voice" forever, she sets off to prove the truth.', 4.8, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('2854d69d-420b-4c89-a596-2f7a692da956', 'The Christmas Star', false, 'Horace McNickle (Edward Asner) is a two-time felon serving prison time for counterfeiting. On the week before Christmas, he escapes from prison dressed as Santa Claus due to his uncanny resemblance to St. Nick resulting from his long white beard and heavyset features. McNickle hides out from the police in a nearby suburban neighborhood where he is befriended and helped by two local children who think he is the real Santa Claus. McNickle takes advantage of the kids naivety to help him get his counterfeit money hidden somewhere in a local department store while he develops kind-hearted feelings for his two con victims that make him slowly understand the true nature of Christmas.', 6.5, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('6fe80d27-6b8e-45f9-a6f2-da3ad79769df', 'Star Pilot', false, 'Aliens from the constellation Hydra crash-land on the island of Sardinia. A prominent scientist, his daughter, several young technicians, and a pair of Oriental spies are taken hostage by the beings so they can use them to repair their spaceship''s broken engine. With that done, they take off towards their home planet, taking the earthlings with them. However, the humans attempt to mutiny against their captors, inadvertently sending their tiny spaceship hurtling into the infinite beyond...', 4.3, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('e2f05005-235a-4f4d-b6b7-76a53cafbed6', 'Star Wars Galaxy of Adventures', false, 'Key moments and characters of the ''Star Wars'' saga are reintroduced in short animations.', 5.1, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('54c59cb0-aa66-4415-8f3e-1f03a5f2e7aa', 'Star Wars: Rogue Squadron II - Rogue Leader', false, 'In this sequel to "Rogue Squadron," Rebel Alliance pilots Luke Skywalker and Wedge Antilles lead the titled squadron on a series of missions that ties in with the universe of the original Star Wars trilogy from the Death Star Trench Run to the Strike at the Core inside the Death Star II.', 8, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('ee3c7593-ddfa-42b1-b392-765966d8639f', 'Super Star Wars: Return of the Jedi', true, 'The Empire is rebuilding the Death Star and planning a big attack on the Rebels. Meanwhile back on Tatooine, the evil Jabba the Hutt is causing trouble. He also has in his possession Han Solo, who''s been frozen in carbonite in the last adventure, so in a land speeder, Luke Skywalker, Chewbacca and Princess Leia rush to Jabba''s palace. After a treacherous ride over cliffs and rocks, you arrive. Leia is dressed as bounty hunter Boush. You rescue Han Solo, then you must defeat Bib Fortuna, survive the Rancor pit, treacherous rides on Skiffs, and send Jabba the Hutt to an early grave! Soon after you all travel to the exotic moon of Endor, while Lando Calrissian leads Rebel pilots into a full scale attack on the Empire. Luke and Leia must survive a fast and furious Speeder rides, avoiding trees. Then they meet Wicket and the rest of the Ewoks who help rid the Ewok Village of Imperial Troops. Luke, meanwhile, heads into the forest and allows himself to be captured and taken onboard the Death Star where he must engage into a lightsaber battle with Darth Vader, and even the Emperor himself! And then, Lando flies the Millennium Falcon into the Death Star and destroys the breaking point, which is the good news because the Death Star will now simultaneously combust. The bad news: you''ve got to zoom out of there at the speed of light, avoiding walls and small ceilings! If you are successful, the Death Star will once and for all be blown away into the heavens, and the Rebels will live happily ever after.', 7.9, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('1c4b149c-c6fd-4251-8f53-e252a887e872', 'Star Wars: TIE Fighter', false, 'You play an up and coming combat pilot serving the Galactic Empire.', 8.8, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('7b750479-b1e9-4998-ab54-564ca9a00a54', 'Radio Star', false, 'Once a superstar with a music award on his belt, rocker CHOI Gon now sings in a run-down caf√©. But an incident with one of the guests at the caf√© has him end up locked behind bars. His manager for more than 20 years, Min-soo makes a deal with the radio station producer to help Gon bail out, and in exchange, to have Gon DJ at a remote radio station in the suburbs. Reluctant to work at first, CHOI Gon soon finds out that the little things matter the most, and his attitude towards his pal and manager Min-soo gradually changes.', 7.1, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('00618a04-8103-4274-82ed-17124fc5156e', 'The Star of Christmas', false, 'Bob the Tomato and Larry the Cucumber appear as Cavis Appythart and Millward Phelps, respectively--two jingle writers based loosely on Gilbert and Sullivan. The setting is 1880s London, and they''ve written a musical called "The Princess and the Plumber", which they plan to open on Christmas Eve. Cavis thinks the production will "teach London how to love". But children at nearby St. Bart''s Church are planning a nativity play for the same evening, and they plan to feature the Star of Christmas, a religious artifact unseen by the public for decades. The London Post Gazette writes a front-page story about the nativity play and the Star, and Cavis and Millward hatch a plan to make their musical better than the children''s play. In the end, they learn about the true meaning of Christmas.', 7, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('c9b4cbc4-fc10-427f-a68a-1852a57dc1a6', 'Grown Up Movie Star', false, 'Grown Up Movie Star tells the story of disgraced NHL star Ray and his precocious daughters Ruby and Rose. Once the town hero, Ray has returned home to Newfoundland from the US following a drug conviction, only to have his wife Lillian leave him for another man and aspirations of stardom. With Lillian gone, Ray flails from woman to woman trying to find a replacement for her, while struggling against a growing awareness of his homosexuality. At loose ends for lack of guidance, Ruby is becoming increasingly curious about her own sexuality and, in a desperate plea for attention, putting herself in increasingly risky situations. Ruby begins spending more and more time with Ray''s best friend Stuart, confined to a wheelchair following an accident involving Ray. When Stuart finds himself attracted to Ruby, dangerously motivated by fear and anger, he leads the three of them towards a heartbreaking conclusion.', 6.1, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
