INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('fa3c3f31-b6ed-40da-a1b5-63d1e67aa0f0', 'The Cowboy and the Movie Star', false, 'Depressed at the thought of losing his family ranch to settle his divorce, cowboy Clint Brannan decides to drive his cattle up to their high pasture. One day into the drive Clint happens across actress Sean Livingston who has run her car off the road in the middle of nowhere whilst out on a drive to clear her head. Faced with the prospect of a two or three day wait for rescue or accompanying Clint on his cattle drive, Sean decides to go on the cattle drive. Completely unprepared for the harshness and privations of living outdoors Sean initially hates the adventure. However, as the drive progresses Sean and Clint start to appreciate the differences and similarities of their respective lives and begin to realize that they have much in common. As the drive progresses fate and the forces of nature intervene to turn the cattle drive into a race against time to reach their destination to save the cattle and then return to civilization as soon as possible to save Clint''s life. Will their fledgling friendship, borne of enforced intimacy, survive and grow or will they go their separate ways?', 6.3, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
