INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('d4346fac-404c-4d22-829e-59b17c6c2579', 'Journey''s End: The Saga of Star Trek - The Next Generation', false, 'Your destination: the 24th century. Your mission: to voyage where few have gone before--behind the scenes of Star Trek: The Next Generation! Join Jonathan Frakes, Next Generation''s Commander William Riker, for this fascinating chronicle of Gene Roddenberry''s beloved, Emmy Award-winning series. You''ll explore the Enterprise, meet the show''s stars (and some villainous guest stars), learn special-effects secrets and makeup magic, and finally get the answer to that nagging question, "Where is the bathroom on the Enterprise?" Other highlights include a visit to a Star Trek convention, and a stop at the scoring stage to watch Marina Sirtis (Lt. Commander Deanna Troi) lead the orchestra in a recording session. This program concludes with a special look at the series'' thrilling final episode ("All Good Things . . .") and a sneak peak at the crew''s movie debut, Star Trek: Generations. So set a course for an adventure like no other.', 7, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
