INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('0ad8cd31-c802-4936-8ae9-37e4aae73959', 'Star Trek: Legacy', false, 'Jonathan Archer, the captain of the first Enterprise, is asked by the Vulcans to retrieve one of their ships that went missing. He locates and saves the ship from the Romulans, but the ship''s mysterious captain T''Uerell decides to use him for her own gain. First Archer, then Kirk, and finally Picard, Sisko and Janeway, will all have to face this dangerous individual in their own eras in order to save the Alpha Quadrant. While Archer, Kirk and Picard each star in one-third of the game, Sisko and Janeway show up only in two of Picard''s missions.', 6.5, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
