INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('11a48e0e-3cb6-41a4-ac95-dd14a671f433', 'Star Wars: Rebel Assault II - the Hidden Empire', false, 'When a Rebel patrol goes missing in the Dreighton Nebula, Rebel pilot Rookie One heads out to investigate and discovers a large Imperial presence in the area. With the help of his fellow Rebels, Rookie One uncovers a plan by Darth Vader to destroy the Alliance by developing an army of "cloaked" Phantom TIE Fighters.', 7.8, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('e49ec52b-e9bc-476d-9837-29908d71d52b', 'Star Ocean: Till the End of Time', false, 'A young 19 year old college student Fayt Leingod and his family are having fun on their vacation in Hyda. While Fayt and his childhood friend Sophia Esteed strolls around the hotel and play the battle simulator, an unknown space force attacks Hyda. Fayt and Sophia were forced to evacuate the hotel and they meet up with their parents. However, Fayt and Sophia were separated from their parents after their escape route falls under attack. Fayt and Sophia later boards the Helre that is heading to Remote Station #6. But however, the Helre went under attack by the space force and everyone was forced to evacuate. Fayt and Sophia boards their escape pods, but they were separated and Fayt lands in the planet Vanguard III. With Fayt by himself, how will he able to find a way back to Sophia and his parents? Fayt must do something about this.', 7.9, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
