INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('0a71cc28-3aca-4075-9078-865c48f6041d', 'Diego Star', false, 'A serious accident occurs on board the Diego Star, a dilapidated Russian cargo ship. Traore, a mechanic from the Ivory Coast, is unfairly blamed for it. The ship is towed to the nearest shipyard for repairs. In the interim, crew members find shelter with the inhabitants of the small local village. Far from everyone he loves and knows, Traore is engulfed by the Quebec winter.', 6.7, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
