INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('42d82746-0c2b-43ca-a59e-43401c6b369a', 'Star Trek: The Experience - Borg Invasion 4D', false, 'A combination of an interactive 3D movie and a stage performance, Borg Invasion 4D was a Star Trek: Voyager-based attraction, part of the Star Trek: The Experience series of attractions at the Las Vegas Hilton in Paradise, Nevada. Borg Invasion 4D ran from 2004 to 2008. The audience enters a small theater where physically present actors portraying the Star Fleet crew greet them. The story is told through prerecorded 3D film sequences and actors'' interaction with them and the audience. The story takes place some time after the end of the ST: Voyager series. The audience takes the roll of guests on a secret space station where Doctor from Voyager works with researches on creating a new DNA strain that will be resistant to the Borg''s assimilation techniques. The guests are there to have themselves tested and help the research in case their DNA contains the resistant strain. Then the Borg attack. Actors lead the audience through a couple of hallways as other actors dressed as the Borg assimilate the researchers. Finally, the audience and the "surviving" actors reach another small theater that represents an escape shuttle and there a new series of prerecorded 3D film sequences starts. The shuttle launches but the Borg cube with the Queen inside captures it. As the Queen taunts the audience, the Borg are tearing the shuttle apart. Just as they are about to reach the audience, a familiar, charmingly raspy, friendly female voice is heard as well as the sound of proton torpedoes. She disagrees that resistance is futile and is there to prove it.', 8, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('3b2d4a65-916c-4594-a332-d55debfb731c', 'Star Trek: Elite Force II', false, 'After the long return journey of the USS Voyager to the Federation, the elite Hazard Team finds themselves declared redundant and disbanded. You play Lt. Munro, the leader of the team who is relegated to being an instructor at Starfleet Academy. After years at the unexciting post, your fortunes change dramatically when Capt. Picard himself has the team reassembled and assigned to the Enterprise. The good captain''s wisdom could not have been better placed as the Enterprise is sent to investigate the loss of contact with the USS Dallas. Leading your Hazard Team, you find yourself at the front line when you discover a formidable new enemy who represents a terrible threat to the galaxy and it will require all your courage and cunning to stop it.', 8.5, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('cc4af1c0-c48d-4917-a8e3-5698e5abef92', 'Star Trek: Bridge Commander', false, 'Space combat simulation about the new Captain of U.S.S. Dauntless, who must investigate why a star suddenly went supernova. The player must work with Captain Picard, Commander Data, and other allies to stop a new Cardassian threat.', 8.3, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('5edf7d30-3d19-43c0-92f5-873c336443c7', 'Star Cops', true, 'The adventures of the International Space Police Force, led by Nathan Spring, in 2027. The Star Cops are made up of officers from all over the world: the British Colin Devis, the Australian...', 7.4, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('e765f559-b97b-41cb-9f94-a69dbada8fd7', 'Fluffy Cumsalot, Porn Star', false, 'Fluffy Cumsalot, Porn Star is an extraordinary documentary about porn stars and their stage names. Featuring Ron Jeremy, Marilyn Chambers, Jenna Jameson, Seymore Butts and over 70 more of the world''s top porn stars, this film is a fascinating and revealing documentary about adult performers and the origin of their on-screen names. At 57 minutes, the film takes a very significant look at an under appreciated aspect of the porn industry - names. How did Ron Jeremy become known as ''The Hedgehog''? Fluffy Cumsalot, Porn Star examines this and goes further by asking legitimate porn stars how they came up with their current stage names and what their names would be if they had used the formula - your first pet and the name of the street that you grew up on. What results are some truly amazing and interesting stories intertwined with footage from movies , interviews and public appearances.', 4.6, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
