INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('d448dc80-7b18-4718-acf1-0ed6b2d08bd1', 'Star Trek: Beyond the Final Frontier', false, 'Forty years after the start of the Star Trek phenomenon, Paramount commissions Christie''s auction house in New York to sell over a thousand original artifacts (spaceship models, costumes, and props) used in the production of the five television series and ten feature films.', 7.3, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('698da587-7f1c-40ea-b125-30df546e2c19', 'Pup Star: Better 2Gether', false, 'The action-packed new season of the franchise continues with the story of Tiny, an adorable Yorkie pup who, after winning the ''Pup Star'' TV singing competition, is suddenly launched into an adventure when she''s replaced by a street Yorkie, Scrappy, and the two swap lives in a dog-filled, fish-out-of-water tale that ultimately demonstrates life truly is ''better together.''', 4.5, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
