INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('ace29fc7-4f00-4bf5-9a42-89bcc140c89d', '9 Muses of Star Empire', false, '''9 Muses of Star Empire'', a year-long chronicle that follows a journey of an all girl pop group ''9 Muses'', portrays the every-day life of nine girls, relentlessly pursuing their dreams in a world of jealousy, betrayal, and scandal. ''9 Muses'' is an emerging girl group, aspiring to perform on a national stage and gain world-wide fame just like millions of others. For that, the girls have decided to set everything aside and live as one of the Muses for ''Star Empire''; the entertainment company which created and coordinated every move. What''s the price they must pay for their dreams?', 6.1, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
