INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('4f053240-35d6-481f-b6e8-d4888a6a2e5f', 'Star Trek: Enterprise - In a Time of War', false, 'Newly produced multi-part documentary featuring all-new interviews with the show''s cast and crew as well as behind the scenes archival content. This retrospective documentary gives fans an inside look at the making of the show''s groundbreaking third season - the first season of a Star Trek series to feature a year-long story arc. Writing staff and production personnel discuss the complexities of plotting the Xindi story-arc and the development of all the major story threads that connected every single episode of the show''s third season.', 7.3, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('f3fddffc-ecf3-46f3-8dd9-4db588452bda', 'William Shatner''s Star Trek Memories', false, 'As James T. Kirk, the intrepid captain of the Starship Enterprise, William Shatner was at the forefront of the world''s most popular sci-fi series. Now, for the first time, Shatner shares his personal rememberances of the original TV series and the Star Trek phenomenon. Joining him are original crew members Leonard Nimoy, DeForest Kelley, James Doohan, George Takei, Nichelle Nichols and Walter Koenig. You''ll hear the never-before-told stories behind Star Trek. How the fans rallied to save the show after it was canceled. How Chekov''s look was styled after The Monkees'' Davy Jones. Why the ship''s chief engineer was Scottish, the origin of Vulcan hand salute, and much more. It''s the behind-the-scenes story of a classic series that lived long and prospered, hosted by the man who captained its amazing journey.', 6.2, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
