INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('60678550-e4d9-43be-96c7-942d70498ec5', 'Magic Star Magical Emi', false, 'Mai is a little girl who idolizes Emily Howell, a famous magician. She is given a magic bracelet to transform into Magical Emi when she says "Pulitto! Palalin Lilikalu Palapola Magical". She soon becomes a very successful part of her grand parents'' show "The Magicalettes" while keeping her eye on a handsome boxer.', 6.2, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('1c258f4b-a34d-4dce-988a-1467b84d82aa', 'The Lucky Star', false, 'In the war-torn Netherlands, a local Jewish boy has vivid escapist fantasies of being in a Hollywood western where good always triumphs.', 6.6, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('ed7bc87a-c311-4911-b44f-0ba1bd84c6ec', 'Billion Star Hotel', false, 'Every day, we''re faced with the following exercise: to give the world around us a certain cue. To smile, to take everything as a joke, to laugh out loud, or to allow ourselves to be overwhelmed by reality. To be painfully aware of the distance between us and our dreams, of the obstacles, and the fact that we are alone all the time. Some choose to escape, to build their own world, with it''s own rules, with the memories of fairy tales and dreams that really come to be. A world where three friends are brought together by the same destination. Or maybe, it all comes down to daydreaming. And feeling the empty spaces with music. It all depends on how you choose to see things. In black, in white, or in sync with the beat. Billion Star Hotel, for each viewer, a different story.', 6.1, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('1148bdef-bff8-44c6-ae33-2b4208986b3b', 'Star Wait', false, 'The new Star Wars film arrived on May 16 - so why not line up on the streets 6 weeks before? Hundreds of people in Hollywood did just that. Star Wait takes a look at the lives of some of these people waiting in line in front of the famous Mann''s Chinese Theater. How do they get along with each other? How do they deal with the homeless people vying for sleeping room on the streets of Hollywood? How do they make sure no one spoils the new Star Wars movie for them? And of course, how do they go to the bathroom? Star Wait is broken up into 9 different episodes. Episodes include; who is hotter: Natalie Portman or Princess Leia? How does a Christian band get along with Star Wars fans at 2 in the morning? The day the tickets are sold, infighting among line members, and of course the final day leading up to the Hollywood 12:01am showing of "Star Wars Episode II: Attack of The Clones."', 6.6, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('eaff7ba0-915d-4683-bb3b-6c5b87de8133', 'Star Wars Gangsta Rap', false, 'Elite members of the cast of Star Wars prove that they are all natural-born homey g''s.', 6.9, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
