INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('a11381a2-c12e-45d7-98cb-a68b00b20c4a', 'Star of India', false, 'Squire Pierre St. Laurent returns from wars in India to 17th-century provincial France to find his estate confiscated by governor Narbonne, for back taxes, and resold to Katrina, a Dutch Countess. Katrina offers to return Pierre''s property if he will help her get possession of the ''Star of India,'' a fabulous sapphire, held at the moment by Narbonne. The Dutch government wants it returned to its Indian worshipers, in order to keep peace. Pierre is a guest at Narbonne''s ch√¢teau during a visit from King Louis IV, who wants to acquire the sapphire for his new court-favorite, Mme. de Montespan. Pierre discovers that the "Star" is hidden in the hilt of Narbonne''s sword, He challenges Narbonne to a duel, gains possession of Narbonne''s sword, extracts the jewel and escapes the castle with Narbonne''s men in pursuit. Katrina is on a Dutch ship in the harbor and is soon joined by Pierre and his pursuers.', 5.6, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('71cb0823-d34c-42b5-b150-cfb647a686b5', 'Star-Crossed', false, 'Join the adventures of a hopeless romantic, an aspiring actress, a salesman, a class clown, a ditsy flirt, a jealous boyfriend, a dream girl, an older sister, and a sarcastic boss. These colorful characters take a fun-filled look at life and love in this smash-hit, award-winning film.', 6.9, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('b620346c-5524-4351-9ae9-8c5c731b8523', 'Star Fox: Assault', false, 'It has been a year since the incident of Sauria and nine years since the last war against Andross''s forces. Now a new threat has emerged from the darkness in the form of the aparoid race, who are bent on galactic domination and assimilation of the Lylat System with the Star Fox team being the only thing standing in their way.', 7.9, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
