INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('a734c461-ebc5-45a7-93dc-2edb91fa40d0', 'John Wycliffe: The Morning Star', false, 'John Wycliffe, the scholar and lay preacher of the 14th century who was later dubbed "The Morning Star of the Reformation", risked his life and freedom to criticize the Church for its abuses of power and its false teachings. The dramatized story of his life includes his battles with Church authorities, his relationship with the peasants and his realization that the Bible must be translated into English, so that the common man, as well as the learned, could read it.', 6.8, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('dd95e88b-b244-4d1c-a216-4e293b5f6a21', 'Star Wreck 2: The Old Shit', false, '', 5, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('7b3dd822-40e1-434a-b338-6fb4fbc8ec2a', 'Grand Star', false, '"Grand Star", formerly known as "Ice Corp.", is a futuristic, action-adventure series based on the saga by French novelist Georges J. Arnaud. In the latter part of the 21st century, there is a cataclysmic explosion on the moon, which was being used as a nuclear waste dump and the earth is turned into a frozen mass of ice. Billions died but a few thousands have managed to rebuild their lives in railway stations like "Grand Star", where they must learn to survive in the frozen landscape home to strange near humans of unknown origin who can withstand the cold and the "renewer" who profess the return of the Sun. Starring Canadian actors Tyler Johnston (Godiva''s, Blood Ties), Kyle Labine (Freddy vs. Jason), Tammy Hui (Battlestar Galactica) and Tristan D. Lalla (Superstorm).', 6.1, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('e4dde454-0836-481b-b9fc-6cc01f073955', 'The Raccoons and the Lost Star', false, '"The Raccoons and the Lost Star" is the last totally original Raccoons .... On a far-away planet, Cyril Sneer plots his takeover of earth.', 8.4, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('a1470651-c359-4d2c-b9f7-f2cd31ea85b0', 'The Star Wagon', false, 'In middle age, inventor Stephen Minch is happy enough with his life, despite the fact that he has never risen to prominence even though his innovations have made others rich. His wife Martha, however, resents his lack of drive, his complacency, his willingness to live hand-to-mouth, and his ever-present and ever-annoying sidekick Hanus Wicks. Confronted by the evidence of Martha''s years-long regret over how their lives together have turned out, Stephen decides to use his newest invention to repair her unhappiness. The new invention: a time machine.', 8, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('42c55519-0c63-4f88-b2c8-7db6caf8ae5d', 'Star Trek: Armada II', false, '', 8, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('29e42053-52d4-4dca-97f6-5fc394213e57', 'Gold Star', false, 'Vicki, a music school drop out, boards a train from NYC to CT to care for her first music teacher, her dying father. While reconciling her feelings toward her upbringing in his old age, she realizes the future she wanted for herself isn''t necessarily the one she needs.', 7.2, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('203149d3-5bc4-4649-a023-db835b33675d', 'Star Wars: The Last Jedi', false, 'Two kids fight with light sabers around the house.', 8, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
