INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('6701b56a-88ad-4ed8-9ae6-1641ccece3ea', 'Like a Shooting Star', false, 'A young yakuza hitman named Goro does a job and needs to hideout away from Tokyo for a while. He hangs out with loose women and hard men and always manages to stay one step ahead of the law...', 7.1, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('dc53a015-5552-483e-b8c0-13f7eb45b352', 'Building Star Trek', false, 'Half a century after it first aired, Star Trek has become not only a pop-culture phenomenon, but also an inspiration for social progress, scientific and technological endeavor, and space exploration. On its 50th anniversary, "Building Star Trek" features scientists, actors, and cultural leaders, asking how did this happen ... and why?', 6.7, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('d51aa5f5-cc0d-4d75-8876-3b5d2bdcd501', 'A Star Is Hatched', false, 'Emily the chicken, lives in Hickville but dreams of Hollywood. Her chance comes when director J. Megga-Phone happens to drive past and gives her his card. She makes her way to Hollywood, and Megga-Phone''s office, where she discovers a whole flock of hens with the same card and a completely uncaring Megga-Phone. She returns home to faithful Clem, and a chick with foolish notions.', 6.4, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('9f2966d3-7401-4559-8570-1b98a4075c7f', 'Natural Born Star', false, 'This is the story of your greatest dream and worst nightmare. It''s a story about visions and dreams, about sailing and wreckage. Natural Born Star is the story of Fred Robsahm.', 7.5, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
