INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('b28d2046-2329-4f43-8d3d-25c05e25a47a', 'Star Trek: Judgment Rites', false, 'A series of missions of the Enterprise, under the command of James T. Kirk: a rematch with Ies Breddell, who has a powerful new weapon capable of destroying the Federation; evidence of advanced technology on a stone-age planet; a reunion with the powerful Trelane, this time obsessed with World War I; a distress call from a barren world; Spock''s abduction by mysterious forces as the Enterprise explores a dangerous rift in space; and terrorists seizing control of a museum with Kirk, Scotty and Checkov trapped inside. Through it all, a reclusive but advanced alien race is watching and testing the Enterprise, wondering if they should break their long silence and make contact with the Federation.', 8.1, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('54858814-5645-4e96-8296-da35fc752d91', 'Northern Star', false, '', 6.3, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('21637440-0b6d-4192-90b2-647ceec94cde', 'Kara: A Star Wars Story', false, 'A veteran X-Wing pilot helps transport a young girl with mysterious powers and her desperate father to an underground Rebel base.', 6.8, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('da3835dc-6894-4215-8e48-5508836e4e0c', 'Teen Star Academy', false, 'The "Teen Star Academy" is an incredible school for all Teenagers who love Music, Dance and Fashion. Each year the selected students will be lead and taught by the extremely talented and very friendly teachers (John Savage, Blanca Blanco, Adriana Volpe, Youma Diakite..), who will improve their students'' skills, in order to prepare them for the "Final Challenge" of the year. At the same time, different stories of friendship, competition and strong emotions of the present and the past, interlace inside and outside the Academy, especially at the "Zelo''s Beach" run by the hilarious Nathan (Bret Roberts) with the help of the crazy assistant Jonathan Bagoro. And there''s more... Among the singing and dancing, new stories will begin; others won''t continue, and some others will begin again. Everything set in the beautiful surroundings of the French Riviera.', 7.3, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('14b6629a-f959-423a-aa0b-7a8f7f0bae49', 'I Am a Star', false, 'A most successful Lithuanian artist duo of Monika and Mantas unexpectedly breaks up as Mantas decides of switching and becoming a rapper.', 2.9, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('51ec1817-b698-4651-872c-7dc4f3090f65', 'Star Wars: Racer Revenge', false, '', 7.2, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('1f640a5b-278f-439d-8ad9-4177abe6bed5', 'Joan Crawford: Always the Star', false, 'This glamorous and hugely popular actress raised herself from brutal poverty to Academy Award-winning stardom by guts, determination and hard work. During her fifty-year career, she made over eighty films. But her obsessive perfectionism led to the later caricature of coat-hanger-wielding harridan that even the adoration of fans could not counter. Still, she has endured as one of the most popular icons of the movies, an early role model to a million young women who aspired to her image of stylish magnetic power and unquestioned independence. She was born Lucille LeSueur on March 23, 1904 (or 1906) in San Antonio, Texas. Her father soon disappeared and she took the name of her stepfather, calling herself Billie Cassin. When Cassin, too, vanished, Billie did menial work to help her mother and brother survive. Ill-paid sales jobs bought dancing lessons and the clothes she needed to enter amateur contests. Then came a night-club contract as chorus girl - $25-a-week and eight routines a night. And so she made it into show-business, but the humiliations and insecurities of those early years would never entirely leave her. Spotted by an MGM scout, by 1925 she was under contract in Hollywood. She made the usual publicity appearaces and did Exhibition Dancing at night. Her vitality, charm and dancing talents earned her many admirers - including some powerful enough to advance her career, like William Haines, Paul Bern, Jackie Coogan, Sr. and Louis B. Mayer. After bit parts and a small role in the film Pretty Ladies, a studio-sponsored competition found her the name she at first hated: Joan Crawford. As Crawford''s acting skills developed, she became known for her independence and her resilience despite some less-than-successful roles. Her vaguely pretty and plump early looks were soon replaced by the svelte, hard-boiled beauty of hollow-cheeks, thick brows and overpainted mouth that would be her permanent image. Her capacity to inspire and wear with flair the creations of the dress designer Adrian was legendary. But most of all, she was known for her hard work on the set. Joan Crawford''s personal life was characterized equally by self-discipline and the determination to better herself, banishing forever her unhappy beginnings. Four husbands included actors Douglas Fairbanks, Jr, Franchot Tone, Phillip Terry and businessman Alfred Steele. Plagued by innumerable miscarriages, she adopted four children, one of whose account of Joan''s unyielding perfectionism has succeded in blurring memories of the remarkable life and career of a Hollywood immortal. Among Joan Crawford''s films from which clips are included: Sally, Irene and Mary, 1925; Our Dancing Daughters, 1928; Grand Hotel, 1932; Dancing Lady, 1933; The Gorgeous Hussy, 1936; The Women, 1939; A Woman''s Face, 1941; Mildred Pierce, 1945; Humoresque, 1946; Possessed, 1947; Sudden Fear, 1952; Johnny Guitar, 1954 Whatever Happened to Baby Jane? 1962 and Strait Jacket, 1964.', 2.7, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('03516992-1387-4773-a5ea-640010d4ba25', 'Star Wars: Starfighter', false, 'A long time ago, in a galaxy far, far away... the greedy Trade Federation stands poised to invade the small planet of Naboo. The only hope for the people of Naboo is a young pilot, a beautiful mercenary, a shifty mechanic and an underhanded pirate who ally to face the invading forces.', 7.3, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('b7da5f72-9ab9-460e-a551-c4d5820ebd7c', 'Star Trek', false, 'You play the crew of the U.S.S. Enterprise as they have adventures staged as the fourth season of the original series.', 7.7, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('0b3e47bb-f3db-41db-a064-5e70f7ca79aa', 'All Star Family Fortunes', false, 'A celebrity version of Family Fortunes (1980).', 5.2, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('240c424f-c5f0-4afe-a220-9b6400517abf', 'The Official Star Wars Fan Film Awards', false, 'The SciFi Channel presents a TV spectacular honoring the best homemade satires of the Star Wars universe from Lucasfilm''s first Offical Star Wars Fan Film Awards. Kevin Smith hosts and showcases all the award-winners, from Star Wars-themed spoofs to documentaries and mockumentaries.', 5.8, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('2ddc59c0-81ba-4ac3-959e-aa04eaedb095', 'All Star Comedy Jam: Live from South Beach', false, 'The all-star comedy line-up includes host D.L. Hughley and featured comics Earthquake, Lavell Crawford, Melanie Comarcho, and Arnez J. This unforgettable night of comedy was filmed in front of a live audience at South Beach''s prestigious Jackie Gleason Theater during the American Black Film Festival.', 6.7, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('f02479eb-1559-426c-9c08-f4165e170f3a', 'Bette Davis - Star und Rebellin', false, '', 8.5, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('11a718af-d0c2-40eb-a2bd-524b131aefc7', 'Star Wars Legends: Legacy of the Force', false, 'Adapted from a portion of the Star Wars novel "INVINCIBLE" by Troy Denning, STAR WARS LEGENDS: LEGACY OF THE FORCE takes you into the last moments of the final conflict between the children of Han Solo and Leia Organa Solo.', 7.1, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('3ea7fdf3-efe7-4ecf-aaac-bbf52aa41799', 'A 5 Star', false, 'In order to pay the university''s tuition, Maryam starts working in a hotel in which she gets accused of having stolen an expensive watch.', 5.5, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('5e243bad-d48e-4377-82a0-2fe6f64733c1', 'Star Wars Droids: The Jawa Adventure', false, 'Having given the auspicious impression that they are finally retiring, the spunky astromech droid R2-D2 has convinced the worry-prone protocol droid C-3PO to join him in assisting an eccentric old scientist named Von Bruneus with an experimental vehicle crafted from a decommissioned and modified Mon Calamari sentry cutter called the Max. After the unanticipated incapacitation of the doctor, the Max crashes safely on the desert planet of Tatooine where the droids ironically find themselves once more at the mercy of scavenging Jawas. A precocious and curious little Jawa named Skeetie proceeds to take the droids on a wild adventure that ultimately ends with a provocative revelation.', 6.8, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('690a1371-60a9-422b-ad54-7ef07660806e', 'Star Worms II: Attack of the Pleasure Pods', false, 'Jessup, forced to hide his true identity, is imprisoned on a deadly and desolate planet, the Star Prison. banished to mine rabid rivers for the elusive Fire Gems, Jessup and his men must battle bands of derelict prisoners and fight the fatal fangs of the Star Worms in order to supply the Lords of the Evil Empire with the sacred source of their hedonistic hallucinogenic opiates.', 2.7, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('91609558-75f8-4f92-ab51-faa7e6489051', 'Pet Star', false, 'This series on the Animal Planet cable network is a talent show for pets. Ten pet owners have their pets perform a specific trick. Among the contestants on the first show were a roller skating macaw; a dog that plays hockey, a Vietnamese pot-bellied pig that painted pictures with a brush, and a girl who hypnotized her pet frog. Each pet/owner team is rated on a scale of 1-10 by three celebrity judges (with new judges each week). The three teams with the highest scores are finalists; the winner is chosen by a vote of the audience. The winning owner receives $2,500 and is eligible for the end-of-season finals and a chance to win $25,000.', 7.2, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('9535d230-3ecf-4ac8-8db3-16bc499cb08c', 'Star Trek: Klingon', false, '', 7.1, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('7d43ec37-47a2-4e3f-a251-0bbba116e2b4', 'All Star Revue', false, 'This early comedy program started off with a rotating cast of four famous comedians, each of whom would take turns hosting the show. The program format was similar to that of a Vaudeville show or stage revue, with the prestige of the hosts enabling the show to bring in equally well-known talent for individual performances. As more hosts were added to the program''s roster, the name was changed to "All Star Revue".', 8.2, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('d9c5a864-43b6-4755-82e2-c6b035bc09da', 'A Man from This Star', false, 'Office clerk Eero Koskinen prefers to spend his nights drinking and reminiscing the war with his friends, instead of taking care of his wife and two children. A two-week drinking spree gets him fired, and a new job is not easy to find because of his reputation. He goes to a rehab centre in the countryside for a couple of weeks, but with no permanent result. Meanwhile, his wife has to get a job and is employed by her old sweetheart, now a recently divorced successful businessman.', 7.5, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('226dffd9-be04-495e-a9e8-136f8c3f4af6', 'Star Wars: Masters of Ter√§s K√§si', false, 'Features all your favorite Star Wars characters, including Luke Skywalker, Han Solo, Princess Leia, Boba Fett and Chewbacca! 3D fighting at its best -- literally hundred of possible moves! Single and two-player modes for an all-out fighting frenzy! Spectacular 3D arenas including Cloud City, Endor and Dagobah! Two ways to fight: hand-to-hand and full weapons -- wield lightsabers, gaffi sticks, blasters and more!', 6.8, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('75e20367-fe06-4171-90a4-9f58d9c54e21', 'Star Trek: Birth of the Federation', false, '', 8.4, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('7e2441bf-e0d1-405d-8502-6f98f2ceaea5', 'Star Trek: A Captain''s Log', false, 'This documentary is a trip through the original series. The whole movie is composed of short fragments showing the high points of original series. Between them we can listen to comments of actors. They talk how they felt during shooting, how they feel the series now and what is the meaning of series for the mankind. The original series is full of allegories and in this documentary they are all presented to us with straight words. All leading characters are presented, decribed and we found out what do they really represent. In last third the movies with original crew are presented and, ofcourse, what is the future of Star Trek. This documentary is full of quotes with which we get impression what Star Trek really is.', 6.5, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('bc8cc8c8-92e1-4e54-aca0-de154269d476', '9 Star Hotel', false, 'Slipping through the predawn darkness over highways, through traffic and across the border, Palestinian construction workers go to work clandestinely in Israel every day. Haar''s raw, handheld photography follows workers who build their own border shanty community to enter Israel more easily, with no choice but to risk their lives simply to earn a living', 7.4, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('9302ed94-9dbb-4dec-aca5-6d0608f21921', 'Like a Star Shining in the Night', false, '', 6.9, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('b9e7c1c8-4bd6-4c17-8bdb-64eb814b82ff', 'Carrie Underwood: An All-Star Holiday Special', false, '', 8.2, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('67774524-f23f-4f08-9d31-97269e40d666', 'The Science of Star Trek', false, 'This documentary compares and contrasts the scientific principles in Star Trek with current science. Many clips from the Star Trek movies and TV series are used to illustrate the concepts of: faster-than-light travel, time travel, anti-particle physics, medical imaging, extrasolar planets, extraterrestrial life and intelligence (SETI and the Drake equation), artificial intelligence, robotics, and matter transmission.', 7.4, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('db038fc9-c678-4aa5-a73a-30e93604237e', 'Star Wars: Yoda Stories', false, 'Under the tutelage of Master Yoda, Luke Skywalker must perform a series of tasks to learn the ways of the Force and become a powerful Jedi.', 6.6, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('da744a02-d2c1-4aca-b9ab-f2b5ddedf0ed', 'P-Star Rising', false, 'At age 9, Priscilla, an adorable yet precocious little girl, tells her single-father, Jesse,: "I am going to become a rapper and fulfill your dreams of succeeding in the music business." Moved by Priscilla''s passion and impressed with her natural talent and undeniable charisma, he begins to teach her all he knows about rapping. In the four years that follow there is no question that rapping has brought Priscilla closer to her estranged father, and that her success has made him proud. Before our eyes, this father-daughter duo go from a one-bedroom shelter in Harlem to a 4 bedroom apartment, from food stamps to shopping sprees, from rapping on street corners to sold out night clubs, and from sneaking under train turnstiles without the $2 fare to spare to being driven around in tinted SUV''s. It is further undeniable that Jesse has been reborn, from looking at old photos and bitterly reflecting on how he never was given the respect he deserved in the music business as a rapper himself to finding his own voice and self-respect as his daughter''s overzealous manager. But in the efforts to make her dad proud, Priscilla struggles to remain a child and finds herself trapped in a world of people twice her size and four times her age and doesn''t know who to trust. Jesse himself is caught between wanting to protect his daughter'' innocence and exploiting her raw talent to fulfill his deferred dream. All they know is that the ride has just begun.', 7.8, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('c08fa1b1-13e2-49ac-88cd-793dbf39e33e', 'The Untitled Star Wars Mockumentary', false, '', 7.1, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('f7d8b4e6-7d2d-4bfe-96dd-9a40da4cdade', 'Star Wars: The New Republic Anthology', false, 'Boba Fett has been trapped for 30 years in the Great Pit of Carkoon; makes his escape and is now allies with the Rebellion.', 7.1, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('9bed45b1-d97f-4576-90a1-606e11bd1fdf', 'Star Stuff: The Story of Carl Sagan', false, 'What are the stars? In search of an answer to that seemingly simple question, Carl, a curious child, sets off on a great voyage of discovery. As one question is answered, more appear. Soon enough, where once stood but a curious boy, a great scientist will rise. "Star Stuff" is a short and sweet film inspired by the life and work of Carl Sagan, one of the most famous scientists and science communicators of the 20th century.', 8.6, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('49ec8afe-0817-4939-b88a-962b98913524', 'Star Wars: Episode XXXVIII - 10 Years Later', false, 'Star Wars Episode 38 is a movie completely spoofing the original trilogy of star wars with jokes and slapstick humor in almost every scene. Follows the characters from the Original Trilogy as if they were comedians years after Episode 6. If you like parodies of Star Wars this movie is for you.', 5.1, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
