INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('f7998548-410a-47e2-a01b-ad2a8807e963', 'The Star Dreamer', false, 'About a visual wizard and a fantastic legacy of films which transformed and influenced the science fiction genre as we know it. The Russian filmmaker, Pavel Klusjantsev, has had an extraordinary influence on an entire genre of films. Throughout his career at the film studio in St. Petersburg, Klushantsev pioneered and invented legendary techniques for filming the planets, stars and weightnessless - long before anyone else. He went on to redefine the science fiction genre and influence the way Hollywood made their science fiction films, including the Academy Award-winning Visual Effects Master, Robert Skotak, a man who spent years trying to track Klushantsev down. This is a film about a fantastic inventor and dreamer whose destiny was intimately linked with the Space Race and the whims of the Soviet dictatorship. However, despite dying blind and penniless, Klushantsev has left an indelible mark on the history of film and inspired countless filmmakers. The Star Dreamer ensures that the name of Pavel Klushantsev lives on.', 8.1, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('1955420b-eb93-4da4-b1ec-5a954968e3af', 'Let There Be Light: The Odyssey of Dark Star', false, 'Exploring the controversial story behind John Carpenter (Halloween & The Thing) and writer Dan O Bannon''s (Alien & Return of the Living Dead) from first feature film. From its humble beginnings as a USC student film, to its modern day status as a cult masterpiece. It also offers a rare glimpse inside the creative minds of two USC film students... who would eventually go on to change the way horror films are made.', 6.6, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('8caa2f30-fad3-4dd0-b884-a76ba209b4be', 'Keiko the Untold Story of the Star of Free Willy', false, 'Millions of Free Willy fans around the world finally learn the truth about what really happened when the whale star, Keiko, became the first and only captive orca to be released back into the wild.', 8.1, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('ecbe3f2a-1f69-4d0e-ae5e-f1b6fbcdaac7', 'I Am Not a Rock Star', false, 'Shot over 8 years, I AM NOT A ROCK STAR follows the tumultuous coming-of-age story of Juilliard trained concert pianist Marika Bournaki (age 12 to 20). Intimately exploring universal themes of dreams, sacrifice, love, family, loss and determination, the film ultimately reveals the elusive alchemy of finding one''s purpose in life.', 7.1, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
