INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('442185ae-6f6a-4762-b19f-78d1659e242d', 'Hibi Rock: Puke Afro and the Pop Star', false, 'Takuro Hibinuma had no talent for sports or aptitude for studying throughout high school and never had a girlfriend. However, he found his true calling when he began playing rock music. While in high school, he formed a rock band named Rock ''n'' Roll with his friends. After graduation, they move to Tokyo and begin playing live shows. One day, at a live house, Takuro meets a world-renowned idol singer named Saki Utagawa and his fate is irrevocably altered when she asks him to write her a song.', 5.6, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('17750cfb-9e2c-422f-b3d9-d7807bf6c95e', '2011 NBA All-Star Game', false, 'A documented movie about the 2011 All-star game which was held in Los Angeles, California. The game was held February 20, 2011 and was broadcasted by TNT.', 8.6, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('bc713f64-9b5b-4417-8d74-1f4d1f7d86da', 'The Stories: The Making of ''Rogue One: A Star Wars Story''', true, 'Divided 10 segments: A Rogue Idea: A recount of John Knoll''s idea and pitch for the film, looking at the early days of production, hiring Gareth Edwards to direct, Edwards'' love for the series, and building a collection of characters. Jyn: The Rebel: A closer look at the film''s main protagonist: personality, character history and what separates her from other protagonists from the Star Wars universe, physical preparations for the shoot, and more. Cassian: The Spy: Much the same as the previous supplement in terms of introducing the character and his history, the qualities the character brings to the story, and casting Diego Luna. K-2SO: The Droid: A look at the robotic character: his "anti C-3PO personality," character design, Alan Tudyk''s motion capture performance, and the humor the actor brought to the set. Baze and Chirrut: Guardians of the Whills: The actors discuss landing and accepting the roles, the characters'' camaraderie, individual character details, faith and the force in the movie and the Star Wars universe, and the actors'' physical performances. Bodhi and Saw: The Pilot and The Revolutionary: The piece begins with Riz Ahmed''s auditions and crafting the character, the character''s fate, and making key sequences. It moves on to examine Forest Whitaker''s character and his history in the Star Wars universe, character definition and history, Whitaker''s preparations for the role, and more. The Empire: A run through of key Imperial characters, including Galen Erso, Orson Krennic, Grand Moff Tarkin, and Darth Vader and the qualities (and in Vader''s case, the presence) their actors brought to their roles. Visions of Hope: The Look of Rogue One: Designing a world that''s true and familiar to the Star Wars universe but still unique to the film. It explores set construction, small design changes, and the black stormtroopers. The Princess and The Governor: Digitally recreating two important characters. Epilogue: The Story Continues (1080p, 4:15): Images from the film''s premiere juxtaposed against fans talking up the film and the franchise. The piece ends with a selection of clips from the film.', 7.2, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('6172bca2-21bc-48a2-81da-25235b559a4c', 'Sparkling Red Star', true, 'The adventure of Dongzi Pan, a boy whose father left home for the Long March in the Red Army and whose mother was killed by gangster of the evil landlord Hu.', 6.6, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
