INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('020aa4da-417e-4348-b5c7-6f0e19b18f71', 'The One: Making a Music Star', false, 'Based on the international sensation, the series will follow the lives of contestants as they attend a fully functioning music academy that turns aspiring singers into music stars through professional training. The show will follow all the drama in the music academy, as it offers vocal coaching and celebrity mentors who will turn potential into talent in a state-of-the-art training and recording facility. Each week contestants will perform live for the American audience, who will have to vote to keep their favorites in the competition. In addition, the contestants'' coaches will also serve as judges. The winner will receive a recording contract with a major record company.', 4, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
