INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('9f90484d-05dc-4aea-b637-c9b5494f7939', 'Shaquille O''Neal Presents: All Star Comedy Jam - Live from Atlanta', false, 'Shaquille O''Neal presents today''s most hilarious stand-up comedians LIVE from Atlanta.', 5.5, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('747c8e05-e98d-4177-86cd-5816ec6592d4', 'Five Star', false, 'Prabhu(Prasanna), Ilango(Krishna), Sundar(Karthik), Priya and Indra are the best of friends at college, swearing to never lose touch with one another later in life. They manage to get jobs in the same company but Ilango, was whisked away to his village by his dictatorial father(Vijayan) and forced into marriage with Eeswari(Kanika). He then runs away while the friends assume that he is in Bombay with his new wife. A few years later the remaining four are still friends, working in the same company and even living in one house. Prabhu meets Eeswari on the train and without knowing that she is Ilango''s wife, falls in love with her. When the truth comes out she becomes good friends with the gang while they promise to find Ilango and reunite them.', 5.7, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('4e7aa785-78cf-475e-a500-791ecdb3a8bb', 'Monopoly Star Wars', false, '', 6.2, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('8dfc67d7-3560-4c85-9677-b45293fd1c8a', 'The Star Maker', false, 'A penniless song writer, Larry Earl, is convinced he is going places in shown business, and convinces Mary, an assistant at an orphanage, to marry him. Fifteen months later they are still in love, but broke as Larry writes songs that won''t sell and loses one job after another one. He stops to watch a group of newsboys singing and dancing, and decides to organize them into the greatest kid act to ever hit vaudeville. Mary persuades Proctor, a big theatrical manager, to book the act, and they are a big hit. Then Larry and his publicity agent, "Speed" King, launch a big publicity stunt---a talent train in which they travel across country holding auditions for young performers. Back in New York, Carlotta Salvini, an ex-OPera singer, brings in her talented fourteen-year-old-daughter, Jane, who has an amazing voice. Larry, to get the mother out of the way, offers Carlotta a forty-week vaudeville tour, and then goes to work to make a star out of Jane, by building Braodway''s first all-kiddie musical revue around her. Opening night has "School Days" as the first act and the show and Jane are a big hit...until the Gerry Society, organized to protect working children, reminds Larry there is a law against children working after 10 p m., and the show closes. Larry''s future appears dim at best.', 6, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('ef8260e4-356a-4892-b9df-cee538ba0cb0', 'Star Trek: The Next Generation Interactive Technical Manual', false, '', 7.6, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('05b16493-e638-4a8a-9981-e599cb96c654', 'The Car That Became a Star', false, 'At a 1965 international auto show in New York City, the key attraction is not a new car but a 35 year old late 1930s-vintage brilliant yellow colored Phantom II Rolls-Royce limousine. Its claim to fame is that it is the star of the MGM feature film The Yellow Rolls-Royce (1964). For filming, the automobile traveled from London to northern Italy (Pisa and Florence) to Austria to Yugoslavia, along the way encountering its several co-stars including Rex Harrison and Jeanne Moreau in London, Shirley MacLaine, George C. Scott, Art Carney and Alain Delon in Italy, and Ingrid Bergman and Omar Sharif in Austria and Yugoslavia. The limo also encountered many fans interested both in the filming and the vehicle itself. During filming, the limo was well taken care of by a large maintenance crew. In its post filming life, the limousine has even inspired a fashionable clothing line by designer Joan Leslie in, of course, the famous yellow motif.', 5.4, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
