INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('2cc69511-83f1-4478-8280-df6ca16916f3', 'An All-Star Toast to the Improv', true, 'To celebrate the "birthday" of the famous Improv comedy club, 6 famous comedians get up on stage and do their thing. However, to make things interesting, while each one does his particular routine, the other 5 comics sit at the back of the stage and heckle the performer. This video is especially notable for Martin Mull issuing a zinger at Robin Williams that shuts-up the otherwise motor-mouthed comic for at least 5 seconds.', 7.2, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('43504df8-16f4-4d62-a1d2-cf40569c96cf', 'Star Quality', false, 'In 1940''s England, a young playwright is getting his first play produced by an important director. But the director wants to get a temperamental actress for the lead. And when Lorraine Barry arrives at the first reading, the battle is begun between director and star, with the poor playwright caught in the middle.', 7.2, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
