INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('00c96666-b312-4de1-a295-aedf10fcab04', 'Inside Star Trek: The Real Story', false, 'Who directed the pilot for the original Star Trek series? Where was it filmed? Who really built the Enterprise? You may own The Star Trek Encyclopedia, and you may have seen every episode, but you still don''t have all the answers! For the first time, the men and women who worked behind the scenes on the most popular science fiction telelvision series ever created invite you to go boldly where no fan has gone before. In-depth interviews will introduce you to the writers, directors, producers, technicians and artists who breathed life into the original Star Trek series. You''ll discover their greatest joys, their deepest sorrows and everything else you ever wanted to know about the greatest show in the galaxy. There are no actors and no special effects. Just the truth.', 6.8, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
