INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('4b6cc7a7-0467-4f35-8a68-4a5170059af9', 'Star Trek Secret Voyage: Whose Birth These Triumphs Are', false, 'Secret Voyage takes place after the completion of the U.S.S. Enterprise''s 5 year mission under legendary Captain James T. Kirk and before the events portrayed in "Star Trek: The Motion Picture". The story begins with Captain Calvin Mercer being called into the office of Admiral Hernadez office and asked to take on a secret mission before he finds out what it is. Bored with his ground assignments Mercer accepts. The mission that he chose to accept involves taking the refurbished Enterprise to the edge of known space and brokering a treaty with an alien race that has developed a new fuel that promises to revolutionize space travel. What seems like a straight forward mission involving first contact with a strange new world and new civilization quickly turns into something much more complicated with sinister overtones and hints of betrayal from within Star Fleet, or...someone else.', 5.9, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
