INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('fbdfb96f-ee42-4938-acb5-6e81b6fe8660', 'Star Appeal', false, 'Chinese activist filmmaker Cui Zi''en crafts the first all gay Chinese science fiction film with this fantastical tale of a lonely extraterrestrial who learns a tender lesson in earthly love after being taken in by a curious bisexual. When Xiao Bo first saw the curious alien, he was alone and naked on a long stretch of highway. He claimed to be from Mars, so Xiao Bo brought him home in order to teach him a thing or two about life on Earth. Dubbed "ET" by his human hosts, the curious alien soon reveals that he has been sent to this planet in order to learn as much as possible about physical interaction. Bisexual Xiao Bo has both a girlfriend and a boyfriend, neither of whom are particularly thrilled that Xiao Bo has brought home a new lover. Later, when Xiao Bo''s girlfriend attempts to have a child with "ET," the alien falls into a deep coma. Now the way to revive "ET" is for Xiao Bo to utter the words "I love you." Once that happens, Xiao Bo resolves to teach his extraterrestrial friend the true meaning of Earthly Love before "ET" travels back to his home planet to reveal his passionate findings.', 4.1, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
