INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('9763c747-a2c7-43c6-87eb-46bed3c55f45', 'Antonio Carlos Jobim: An All-Star Tribute', false, 'Direct from Brazil in his last recorded performance, Antonio Carlos Jobim (1927-1994) is joined by an international delegation of jazz giants to recreate his classic melodies in a beautiful, concert-length "Thank You." With over four hundred songs to his credit, including the unforgettable "Girl From Ipanema," Jobim virtually singlehandedly brought the world the Bossa Nova. Adapting the percussive excitement of the Samba to the intimacy of the guitar while echoing the melodies and harmonies of Cool Jazz, Jobim''s new sound quickly became a staple ingredient in the jazz cookbook, and in 1991 Jobim was inducted into the Songwriter''s Hall of Fame.', 7.6, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
INSERT INTO content.movies_movie (id, title, is_suspicious, description, imdb_rating, age_rating, certificate, created, creation_date, file_path, type, updated_at) VALUES ('b1f6eeae-25f8-4e3b-956c-3ac4777b7b76', 'America''s Five Star Heroes: Gods of War', false, 'The careers and World War II triumphs of the nine generals and admirals who achieved 5-star rank in the U.S. military.', 8, NULL, NULL, '2023-10-19 10:51:38.534701+00', NULL, NULL, 'movie', '2023-10-19 10:51:38.557443+00');
